	(26, '2025-11-06 02:11:32.997377+00', '2025-11-06 02:13:10.77+00', 21, '', 'Operator inspection checklists are up-to-date and aligned with equipment maintenance strategy. (Daily, Weekly, Monthly). Defects found as a result are entered in the SAP in a timely manner considering:
 Safety
 Materials
 Tasks including specification
 Additional Resources
