	(61, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 69, '1. How are new employees being trained in Work Identification and Notification creation?
2. Have Operators (if applicable, e.g.. inspection routes) and Maintainers received Work Identification training?
3. Are there any training gaps in your organization regarding entering a work request into your SAP?
4. Have Service Providers / contractors received Work Identification training?', 'Operators / maintainers / Maint professionals / contractors receive training in Work Identification and Notification creation, considering:
 Work identification is incorporated into new employees training
 Sources of training materials may be:
o > Site-specific Work Identification training
o > Work Identification Awareness presentation
o > SAP raising notification training.', 1, '00000000-0000-0000-0000-000000000001', 'Work Identification Training', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(62, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 69, '1.  Is all of the PM Work set up within the SAP?
2.  Is most of the PM work calendar-based, and/or based on OEM recommendations, rather than tactics reviews? 
3.  For new equipment, is PM Work  based on formal Asset Tactics Development?  What is the process for entering them into the SAP? 
4.   What is the process for modifications to existing tactics, and entering them into the SAP?   How often are formal reviews undertaken?
5. Preventative work orders are part of the maintenance regime (PM02)', 'PM Work has a defined scope and frequency, and originates from the asset maintenance strategy, and built into its maintenance tactics. The maintenance tactics are a set of activities carried out to enable the realisation of the defined reliability/availability of the Asset. All maintenance strategies and tactics are created within the SAP for automatic generation as PM01
', 2, '00000000-0000-0000-0000-000000000001', 'Identification of PM work', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(63, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 69, '1. Are there Operators'' checklists for all equipment? (Note this refers to inspection checklists, not merely pre-op inspection forms).
2. Is there alignment with the checklist details and the maintenance strategies? How are changes to inspection requirements and strategies transferred to the checklist? 
3. All are all defects entered as Notifications in the SAP in a timely manner?
4. Do Notifications typically represent all aspects of the true condition of the equipment?', 'Operator inspection checklists are up-to-date and aligned with equipment maintenance strategy. (Daily, Weekly, Monthly). Defects found as a result are entered in the SAP in a timely manner considering:
 Safety
 Materials
 Tasks including specification
 Additional Resources
 Feedback / comments field
 Sign off.', 3, '00000000-0000-0000-0000-000000000001', 'Inspection Checklist Design - Operators', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(64, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 69, '1. When inspection checklists are performed by maintainers, are defects found entered in the SAP?
2. Is there alignment with the checklist details and the maintenance strategies?
3. How are changes to inspection requirements and strategies transferred to the checklist? 
4. Are defects found as a result of inspections scheduled using the standard Maintenance Planning Process, or executed as part of "scheduled" work?', 'Inspection checklists are up-to-date and aligned with equipment maintenance strategy. (Daily, Weekly, Monthly) considering:
 Safety
 Materials
 Tasks including specification
 Additional Resources
 Feedback / comments field
 Sign off.', 4, '00000000-0000-0000-0000-000000000001', 'Inspection Checklist Design - Maintainers', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(65, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 69, '1. Are notifications written in a timely manner, to the appropriate level of maintainable item in the hierarchy and with sufficient detail to process?
2. Are all defects being captured in SAP and are notifications written to the appropriate level of maintainable item in the equipment hierarchy?
3. Are notifications written which capture accurate failure modes?
4. What ratio of Notifications are being generated by operations and maintenance?
5. Are notifications being reviewed and screened daily to insure all valid items are addressed?
6. Corrective work orders (PM01) are generated by RDC, by condition monitoring processes, as follow-on work orders from preventative work or modifications via change management committee', 'All work requests are  recorded in the SAP as Notifications. This includes identifying work found as a result of  Reliability inspections.  
Adequate information to process the notification is included:
   What:   A description of the fault or request for maintenance, including any troubleshooting performed
  Where:  Identifies the maintainable item requiring maintenance
  When:   Pinpoints when the fault occurred and sets the priority for the task 
to be performed
  Why:  Relates why the work need to be performed (failure modes)
', 5, '00000000-0000-0000-0000-000000000001', 'Maintenance Request / Notification Process', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(66, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 69, '1. How are priorities currently being determined?
2. Do operations and maintenance superintendents/supervisors discuss and negotiate priorities?
3. Are priorities set based on equipment criticalities?
4. Does the planner work from the prioritised work list?
5. Capital work orders (PM03) are generated as part of the maintenance regime and are associated with specific items', 'Priorities of work being performed must be determined based on set guidelines and in line with maintenance and operational requirements.
', 6, '00000000-0000-0000-0000-000000000001', 'Work Request / Notification Priority', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(67, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 69, '1. Do operations use SAP to understand their area''s asset health?
2. Do planners and area team leaders look outside their regular parameters to check for incorrectly coded Notifications that have "fallen through the cracks"?
3. Do Notifications rejected for more information obtain the follow-up required?
4. Are Notifications checked for duplicate entries within the SAP?  Do notifications get reviewed and approved prior to WO creation?
5. Are job requests being reviewed for urgency, quality of job information, assignment to correct productive unit and work centre and then approved/actioned in a timely manner? ', 'For effective planning of maintenance tasks, Operations, Maintenance and Service providers must review Notifications on a regular basis, and ensure that incorrectly coded notifications are recoded for processing.
', 7, '00000000-0000-0000-0000-000000000001', 'Work Request / Notification Review', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(68, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 69, '1. Are all known equipment faults or issues recorded in the SAP through the formal process?
2. Is the majority of work done during a maintenance event known about in advance and captured in the system?
3. If a detailed inspection was done on a piece of equipment how many of the faults / issues found would already be in the SAP?
4. Are predictive/condition based technologies used to identify maintenance?', 'The ultimate aim of the identify step is to ensure that the ACTUAL condition of the equipment is captured in the SAP.', 8, '00000000-0000-0000-0000-000000000001', 'Representative of Equipment Condition', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(125, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 78, '1. Is the criteria for success clearly defined and understood by the team and management?
2. Do the KPIs both help to track and manage project progress and ultimately whether or not the project goals were achieved?', '
A measurement plan is in place that includes a baseline with appropriate measures / KPI and targets.', 4, '00000000-0000-0000-0000-000000000001', 'Establish a measurement plan', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(69, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 69, '1. Is any work coded as Improvement work?
2.  Is Improvement work evaluated prior to progressing to planning/scheduling/execution, etc.?
3.  Is the MOC process followed for Improvement work?
4.  Are risk assessments and cost analysis performed prior to progressing?', 'Improvement work may flow in from a number of sources: 
 Environment, health, safety and community relations
 Incident investigations
 Reliability analyses
 Defect elimination investigations
 Operation uptime initiatives
 Cost reduction analyses
 Asset life cycle plan.', 9, '00000000-0000-0000-0000-000000000001', 'Identify Improvement Work', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(70, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 69, '1. Are subsequent notifications being created?
2. Is the information used to improve the maintenance strategies?
3. Do high level PM''s exist that allow corrective work to be completed without raising a subsequent notification?', 'Subsequent, or related, notifications can be coded as such in the SAP.  Some items to note:
  A subsequent notification should be created if additional work is discovered while performing a task on a work order.
  The original work order can be categorized as any type of maintenance work.  However, subsequent notifications are most often found while performing PM work.', 10, '00000000-0000-0000-0000-000000000001', 'Identify Additional Work Found During Work Execution', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(71, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 70, '1. Has the Aurizon Maintenance Planning Process been communicated and made available to all?
2. Is current planning performed as per the Aurizon Maintenance Planning Process?  As applicable, do job scopes include clean-up, decon requirements, and rotables information?
3. Parts availability is being verified before scheduling of tasks?
4. Are Tasks rejected which don''t comply with current equipment tactics, or rescoped to align with Budget, Tactics, operations and or Equipment stability requirements?', 'To ensure that the planning function is performed in the same manner all the time, well document planning standards for work orders and work management must be in place and followed:
 Workshop visits by planners during planning of major tasks
 Task frequencies and durations captured
 All resource, materials, shared equipment requirements captured
 Safety requirements determined and captured
 Validity of Task reviewed in relation to Tactics
 Additional documentation (checklists) attached
', 1, '00000000-0000-0000-0000-000000000001', 'Scoping Work', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(72, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 70, '1. Long Term Planning (LTP) develops plans for Preventative and Capital work >26 weeks
2. Depot Planning receives handover from LTP and is responsible within 26 weeks for Preventative, Corrective and all other work order types until handover to Depot Scheduler at 3 weeks
3. LTP and Capital Planner is responsible within 26 weeks for Capital Work
4. Handover from LTP to Depot Planner occurs at 26 weeks on a rolling monthly basis', 'Capital Planning tasks are managed by Long Term Planning (26 weeks to 3 weeks).  Clear differentation of maintenance tasks required to assign maintenance planner form Asset Managament & Startegy or Business Unit.', 2, '00000000-0000-0000-0000-000000000001', 'Long Term Planning Horizons & Tasks', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(73, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 70, '1. How many task lists are available?  What % of work (PM, corrective & breakdown) is created from task lists or standard jobs?
2. Are the task lists that are available used including ordering of required material for jobs? 
3. Is there are formal process to update and create new tasks lists? 
4. Are task list instructions detailed with specification or are they "Is motor hot?" or "Check Alignment"? ', 'To reduce the amount of work, and support continuous improvement, standard jobs or task lists should be used during the planning process.
A Job should only ever be planned once, saved as a task list or standard job, and then improved over time.', 3, '00000000-0000-0000-0000-000000000001', 'Task List / Standard Jobs', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(74, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 70, '1. Is the concept of backlog, forward log and future log understood?
2. Does the forward log reflect the actual next available down-time condition of the equipment?
3. How often is the backlog being managed and by whom?
4. Is equipment criticality taken into consideration during the Planning process and workload reviews?', 'To enable effective loading of scheduled maintenance tasks, the Workload must be consistently updated, accurate, and include:
 No duplicate tasks and no standing work orders
 Resource requirements including contractors and support equipment
 Task durations
 Intended start date, in the future
 Priorities set.', 4, '00000000-0000-0000-0000-000000000001', 'Backlog / Forward Log Work Management', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(75, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 70, '1. What percentage of work orders are planned with a complex task (operations) structure?
2. Is data such as master warranties and equipment install/dismantles entered and updated in a timely manner?
3. Do the majority of planners only enter and manage data in the minimum required fields?', 'The SAP must be actively managed to ensure the Work Management process works properly and efficiently, and data is available for later reliability analysis. Data requiring management may include:
 Proper work order coding with regards to user statuses
 Differentiating warranty work
 Install / Dismantle of equipment (rotables)
 Review of job plans requiring complex planning
', 5, '00000000-0000-0000-0000-000000000001', 'SAP Management', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(76, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 70, '1. Do planners understand the essential information required in a work package?
2. Are the work packages prepared and available before the scheduled work period?
3. Do work packages require frequent modifications or do they adequately detail the required work?
4. Are work packages with multiple work orders used and when?', 'Before work commences, and to allow for effective execution of the planned work, maintainers must be provided with a complete work package.  Depending on the size/duration/complexity of the job, a work package may be a binder, or simply a printed job card (shop paper).
Work Packs should include:
 Start-up, test, demob and clean-up requirements including return of unused parts and repairables
 Materials listing
 Space for feedback
 Gantt charts (if applicable) 
', 6, '00000000-0000-0000-0000-000000000001', 'Work Packages', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(77, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 70, '1. Are ordered parts on site in time to schedule work orders?
2. What portion of parts are on site JIT for the maintenance activity?
3. What portion of parts are returned for poor quality or incorrect parts delivered?  Are left-over parts returned on a timely basis?
4. Are BOM''S on the system up to date and used?
5. Have all requisitioners been trained on requisitioning procedures and SAP system? (for example, checking lead-times, setting delivery dates, correct cost assignment)', '
An effective parts management process incorporates the following criteria. 
 Up to date Bill of Material (BOM''s) & inventory levels          
 Parts ordered from BOM''s, or updated if not
 Correct requisitioning, to the correct work order and use of lead times
 Effective Planner / Warehouse communications
 Parts tracking monitored                                                                                                         Use of Materials Availability reporting, if available
 ', 7, '00000000-0000-0000-0000-000000000001', 'Material Management - Process', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(78, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 70, '1. Is there a heavy reliance on use of on-site bin-stock, such that supervisors or maintainers are kitting their own work?
2. Are staged parts in clearly marked bins with the work order identified?
3. How often are parts missing in the bins  or parts incomplete?
4. Is everyone aware of the staging process?
5. How many days in advance are parts kitted and staged for execution?', '
An effective job consolidation process incorporates the following criteria. 
 Job consolidation (kitting and staging) occurs                         Clearly marked bins
 In time delivery and staging
 Complete and correct parts
 Work order number, req number & materials listing displayed
 Located close to work area
', 8, '00000000-0000-0000-0000-000000000001', 'Material Management - Kitting & Staging', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(79, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 70, '1. What percentage of a planner''s time is spent actually planning future work?
2. Do planners act as "parts chasers"?  Are they expediters or planners?
3. Are planners doing most of the planning for Urgent breakdown work?
4. Are BU planners required to ''fix'' planning gaps for capital works?
', '
Planners should remain focused on planning future work, without distraction from supervision tasks, or managing breakdowns and interrupt work, and associated emergency parts procurement.
', 9, '00000000-0000-0000-0000-000000000001', 'Roles / Responsibilities', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(80, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 71, '1. How far in the future is the rough-cut schedule developed and documented?
2. Is the rough-cut schedule regularly reviewed with Operations? How far in the future?
3. Does the rough-cut schedule take the operations schedule into account ?
4. Are there any measures in place or reporting undertaken to ensure this process is followed?

Is the long-termplanning horizon long enough to allow for effective resource planning and an integrated maintenance and operations plan?', '
Long term, rough-cut schedules must be developed to assist with budgeting and co-coordinating of major maintenance shutdowns and other significant events affecting operations planning and consider:
 Rough-cut capacity scheduling is a key element of forward log maintenance planning
 Maintenance and operations schedules are integrated
', 1, '00000000-0000-0000-0000-000000000001', 'Long Term Scheduling Time Horizons', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(81, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 71, '1. How are non-maintenance activities (training) managed?  Are there any standing work orders used for scheduling?
2. Is there a formal process for forecasting and reviewing the need for additional resources?
3. Are the work centre capacities (available man-hours) managed weekly for internal resources and alliance contractors?
4. Is system functionality for resource tracking used to its fullest extent?', '
Effective scheduling of work requires control of resources including contractors utilising the following:
 Leave guidelines
 Training guidelines and/or competencies
 Use of available system functionality (preferable),
 Use of manual resource tracking tool
 Alliance contractor work centres are set-up and managed
', 2, '00000000-0000-0000-0000-000000000001', 'Available Resources', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(82, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 71, '1. Are the guidelines determined and documented?  Have these been communicated and aligned with current metrics?
2.  Does the amount of people available drive what work is scheduled, rather than what work is required drives determines how many resources are scheduled?
3. Is work order resource planning adequate to enable scheduling of available resources?
4. What percent of available resources are scheduled on a weekly basis?
5. Is reporting on Resource Utilization and Use of Resource Availability reviewed regularly?', '
Some guidelines for effective utilization of all resources must be communicated and followed and include:
 No standing work orders used
 Loading per person per week in hours
 Non-maintenance activities are deducted from available hours
 Work centre resource management
 Review of KPI''s to determine proper schedule loading
', 3, '00000000-0000-0000-0000-000000000001', 'Schedule Resource Loading', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(83, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 71, '1. Are there a regular scheduling meetings?
2. Do the right people attend?
3. Is the scheduling meeting agenda followed, is there a meeting chair and are minutes taken for distribution?
4. Are improvement actions being assigned weekly? Is there an Actions Log?', 'There should be formal ''schedule'' meetings.
 Operations and maintenance sit down to discuss the proposed schedule. This is done in tandem with the operations schedule. Any active discussions regarding schedule inclusions should happen at this meeting.
 The teams get back together to formally lock down the schedule. This discussion should be a formality and should rarely involve disagreements on the schedule inclusions. The timing of the second meeting is usually dictated by the lock-down date in the SAP.', 4, '00000000-0000-0000-0000-000000000001', 'Scheduling Review/Lock in Meetings', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(84, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 71, '1. Does break-in work often take the place of primary work?
 2. Are maintenance strategies set up in SAP to trigger work orders at recommended intervals?
3. Is including of secondary and breakdown work in the schedule based on priorities and criticality?', 'Identified Maintenance strategies/tactics (Corrective & Breakdown) represent work required to increase the reliability of the equipment.  This work should be given high priority when creating the schedule.
Considerations include:
 Breakdown jobs given high priority
 Work order priorities for including work in schedule
', 5, '00000000-0000-0000-0000-000000000001', 'Scheduling of Maintenance Strategies/Tactics', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(85, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 71, '1. Are scheduled spares consolidated in a staging area prior to the scheduled activity?
2. Is there a role allocated (e.g., Scheduled Spares Coordinator) to managing Scheduled Spares?
3. Are spares being checked prior to the job being scheduled and is the material tracking report used for this?
4. How often are scheduled jobs called off due to the spares not being on depot/P&E, or the wrong spares having been ordered or delivered?', 'Best practice would see materials managed using a Just-in-Time philosophy. This minimises stocked inventory and, in turn costs. However, particularly for isolated depot/P&Es with potential supply chain logistics issues, this is not always practical.
It is accepted that, in order to reduce the risks presented by these issues Aurizon depot/P&Es should be protecting their maintenance schedules by ensuring spares and materials are on depot/P&E before the Operations are scheduled.
', 6, '00000000-0000-0000-0000-000000000001', 'Material Management - Scheduled Spares', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(95, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 73, '1. What is the variance between Planned vs. Actual being reported?
2. Are maintainers aware of the importance of capturing accurate times to work orders?
3. Does a time and attendance process drive a behaviour of capturing incorrect actual times to work orders?
4. Is there a process for optimising task lists or standard jobs based on actual times historical information?', '
The accurate capturing of time actually worked is critical. This will allow for:
 The optimisation of planned labour hours on future tasks
 The correct labour cost allocation to work performed
 Must include delay times e.g.: waiting for parts etc.
 Timecard confirmation review process in place.', 3, '00000000-0000-0000-0000-000000000001', 'Time Confirmation', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(86, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 71, '1. Is there a formal weekly scheduling meeting and are operations, service departments and contractors consulted when developing schedules?
2. When is the schedule committed or Snapshot performed and how far in advance of the snapshot is weekly schedule completed?
3.  Do schedules often change after they are agreed to?
4. Is the scheduling of PM''s based on the outstanding work hours and not a fixed downtime duration? (12 hours every PM)
5. Is there a formal post-mortem review meeting, and action items assigned and completed in a reasonable time?', '
Priorities of work to be determined based on set guidelines and in line with maintenance and operations requirements considering:
 Input based on operations objectives
 Safety / Environmental priorities
 Support equipment availability
 Possible contingency plans                                        
 Review of Materials availability                                 
 Schedule needs to be agreed & confirmed                          
 Work packages and/or job cards are part of published schedule 
', 7, '00000000-0000-0000-0000-000000000001', 'Weekly Schedule (Quality) Output', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(87, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 72, '1. Are critical jobs and/or tasks handled differently?
2. Are additional faults/defects identified during the course of work not completed due to lack of communications between shifts?
3. Are delay causes identified and relayed to oncoming crews?
4. How well prepared are the oncoming crew members when they leave their shift start briefing?
5. Are improvement actions captured during the shift start meetings?', '
To create awareness for oncoming crews an effective handover / turnover process must be in place and address the following:
 Participated by all relevant personnel
 Current progress on planned work
 Possible operations requirements during shift
 Causes for delays, if any
 Changes in environment / risks
 Additional faults / defects found
 Work packages handed out and reviewed as required', 1, '00000000-0000-0000-0000-000000000001', 'Daily Shift Start / Shift Handover', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(88, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 72, '1. Does the operator have the ability to refuse acceptance of  equipment?
2. Does Operations often insist on equipment release prior to completion of maintenance activities?
3. How often does equipment fail shortly after a maintenance intervention?
4. Is there timely operator acceptance of equipment?', '
Formal procedure for interaction between maintainer and operator at equipment exchange (shut down and release) and incorporate the following:
 Actions required or taken
 Permits & isolation concerns
 Status / condition of equipment
 Equipment / functional testing after maintenance
 Timely acceptance by operator(s) upon release
 All tests, clean-up, demob, parts & repairables returned.', 2, '00000000-0000-0000-0000-000000000001', 'Equipment Handover & Release', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(89, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 72, '1. How often does the scheduled work get stopped to perform non-routine work?
2. How are decisions being made as to what scheduled work gets stopped and by whom?
3. Is break-in work being monitored and reviewed to ensure that it is truly urgent work?', '
Priority should be given to performing scheduled work and schedule interruptions must be managed and based on interactions between maintenance and operations.
', 3, '00000000-0000-0000-0000-000000000001', 'Urgent or Unscheduled Work', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(90, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 72, '1. How often does the supervisor visit tasks during execution?
2. What questions are asked during these visits? 
3. Does the supervisor seek out problems and contribute to the solutions?
4. Does supervisor communicate his findings with crews to avoid repetition of failures?', '
To monitor work execution activities and provide feedback on progress and quality of work
 SHE is observed, questioned and corrected
 Work quality interaction
 Delays recorded
 Actions & contingencies listed
 Improvement opportunities identified.', 4, '00000000-0000-0000-0000-000000000001', 'Floor tours', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(91, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 72, '1. Are jobs often deferred due to lack of spares or spares not arriving in time for scheduled work?
2. Do Supervisors and Maintainers keep squirrel stores or their own ''stash'' of spares?
3. Are spares consolidated and delivered to maintenance on the day they are required?
4. Are the right spares kept on the shelf?
5.Is there a process to investigate the cause of parts not being delivered in time for execution?', '
 Spares should be managed as close to a just in time approach as possible without creating undue business risk.
 Spares should be kitted & staged and delivered to the scheduled spares area on the day required.
 All spares should be managed within the stores.
 BOM''s should be immediately updated when found to be incorrect to ensure parts aren''t over or under ordered for jobs.
', 5, '00000000-0000-0000-0000-000000000001', 'Material Management - Execution Spares', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(92, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 72, '1. Does the supervisor review day to day scheduling compliance with planners and crew?
2. Are there delays in equipment delivery to maintenance by operations?
3. Is there a process to reschedule incomplete tasks?
4. Is input from the maintenance crews captured to provide improvements in the history captured and future work planning improvements?', '
Monitoring the productivity of the maintenance crews will ensure the completion of maintenance activities as per the plan and schedule and efficient use of opportune time.  This is achieved by monitoring and reporting:
 Planned vs. Actual Performance
 Rework
 Work quality interaction', 6, '00000000-0000-0000-0000-000000000001', 'Productivity & Quality', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(93, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 73, '1. Have maintainers received Work Order Completion training?
2. Do maintainers understand the importance of capturing work order history?
3. Have alliance contractors  received Work Order Completion Awareness training?
4. How are new employees being trained in Work Order Completion?', '
 Aurizon training should be formally provided to new employees and any necessary contractors, and if necessary refreshed annually 
 Online training material is readily available and linked to the relevant sections of the WMP.', 1, '00000000-0000-0000-0000-000000000001', 'Work Order Completion & Confirmation Training', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(94, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 73, '1. What quality of information is being captured onto work history, and feedback / coaching provided to maintainers?
2. Does the information get captured into the SAP? How?
3. Do RE''s use available data for analysis?
4. What percentage of maintenance work orders have history included when Techo''d?', '
For continuous analysis of failures, the feedback from maintainers into SAP is critical and must include:
 Detailed information on work execution
 Failure modes, causes, parts used and delays recorded    
 Actual time worked (tool-time)
', 2, '00000000-0000-0000-0000-000000000001', 'Record Maintenance History', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(96, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 73, '1. How much variance in performance data based on delayed closing of work orders?
2. Are maintainers aware of the consequence of delayed closing on performance metrics?
3. Do supervisors use the metrics to drive behaviour change in closing or work orders?
4. SAP-sites question: How many jobs are TECO''ed with zero (0) hours?', '
The Closing / confirming process is a critical step in WMP performance metrics and must be done in a timely manner.
', 4, '00000000-0000-0000-0000-000000000001', 'Closing Work Orders', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(97, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 73, '1. Are there materials left lying around the work area after work is completed and then tidied up on an adhoc basis?
2. Is there clear cleaning and tagging requirements and delivery locations for rotable, repairable and unused materials?
3. Does everyone know the requirements and follow them?
4. Is the SAP updated in the appropriate way to ensure that credits are applied to the correct cost area and the inventory levels managed?', '
It is important that repairable, rotable and left over materials are well managed and consider:
 Must be done in a timely manner
 Ensures a safe workplace
 Correct information must be supplied
 Install / Dismantle procedures for Rotables is followed
 There are no outstanding material requirements on TECO''ed work orders.', 5, '00000000-0000-0000-0000-000000000001', 'Material Management - Complete', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(98, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 74, '1. Is the schedule (spreadsheet, Gantt chart, etc.) referred to during the review?
2. Is Maintenance & operations related delays/losses discussed?
3. Is action item list up to date with names & dates?
4. Are actions completed in a timely manner?', '
Weekly plans, schedules and metrics reviewed to identify potential improvement opportunities.
 Participation from both maintenance, operations and service departments such as Warehouse
 Agenda followed and minuted
 Identify what went well
 Identify what did not go well - potential improvements
 Identify what can be done to prevent recurrence of non-conformance.', 1, '00000000-0000-0000-0000-000000000001', 'Meetings - Weekly Review', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(99, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 74, '1. Work order completion is reviewed? Do maintainers attend these sessions?
2. At the 24 hr review, is the following done: Any PM not scheduled needs to be questioned. Any Corrective needs to be questioned. Did it need to be done straight away or could it have been scheduled?
Is the failure mode captured in the equipment PM?
If Yes, Do we need to complete an RCA, PMO on the strategy applied? Is there an action plan?
3. Is action item list up to date with names & dates?
4. Are actions completed in a timely manner?', '
Daily Review to identify potential improvement opportunities
 Agenda followed and minuted
 Identify what went well
 Identify what did not go well
 Identify what can be done to prevent recurrence of non-conformances
 Discuss any  Notifications raised or whether or not a Noti is required for something
', 2, '00000000-0000-0000-0000-000000000001', 'Meetings - 24-hour daily review', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(100, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 74, '1. Are metrics posted and up to date?
2. Are metrics understood by all?

 - Are appropriatemetrics in place to measure effectiveness of the work management process? 
 - Are the metrics accessible to all relevant personnel and stakeholders?
 - Are metrics posted and up to date?
 - Do the metrics include quality and cost performance?
3. Are new metrics being rolled out on a regular basis?', '
Appropriate metrics must be in place to measure effectiveness of process:
 Metrics developed 
 Posted in appropriate work areas
 Utilised to drive behaviour change
 Review of overdue statutory requirements
', 3, '00000000-0000-0000-0000-000000000001', 'KPI data', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(101, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 74, '1. How is repetitive failures reported to the Reliability Group?
2. Does the Reliability group have access to the KPI''s and WM system?
 3. Where are all the reported findings /  recommendation captured - are the teams using Notifications?
4. How does the information get reported back to the maintenance teams?', '
Interaction between the WMP and the Reliability Processes (Defect Elimination & Asset Strategy & Tactics) is crucial and must include:
 Loss Analysis data
 Repetitive failures occurrences (chronic/systemic)
 Changes in Tactics
 Changes in operating conditions
 Improvements or recommendations
 Cost over-runs
', 4, '00000000-0000-0000-0000-000000000001', 'Work Management Feedback to / Inclusion of Reliability Group', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(102, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 74, '1. Is the SAP capable of easily generating routine reports and data extractions for:
  - Budgeting and cost control.
  - Quality work orders and check sheets in a user  friendly format, attachments such as drawings or  photos.
  - Quality schedules in a user friendly format
  - Equipment history sorted as required
  - Pareto and other data analysis
2. Do links exist to the following systems:
Finance including payroll and budgeting?
Supply including inventory, warehousing and  purchasing?
operations reporting and delay logging?
Maintenance systems such as equipment  strategies, condition monitoring, maintenance  procedures, drawing and equipment registers?
Other systems such as safety, environment or
quality?', '
A SAP is an essential part of the Asset Management Business Process.  The extent to which it is developed and used can create a significant impact on the capability and effectiveness of a site''s asset management function.  This practice aims to understand the level of maturity of the SAP on the site.', 5, '00000000-0000-0000-0000-000000000001', 'SAP/ERP (Enterprise Resource Planning)', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(103, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 74, '1. Are there clearrolesandresponsibilities defined within each step of the work management process?
', '
Clear diliniation between reliability & Planning, maintenance, supply & operations is key to process consiistency and efficiency
', 6, '00000000-0000-0000-0000-000000000001', 'Roles / Responsibilities', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(104, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 75, '1. Is there an automated system to capture Operation loss,
2. Is the system covering all areas of Operation,
3. Are failure modes and causes captured?', '
A process exists to capture Operation lossesandequipmentdowntime/delays', 1, '00000000-0000-0000-0000-000000000001', 'Operation Loss Monitoring', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(105, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 75, '1. Are all Operation areas accounted for?
2. Are all sources utilised?
3. What data sources are used?
4. What are the DE data sources in use at site?', '
Defects are identified through the analysis of various sources of data. 
Potential data sources include:
 Operation Performance data
 Maintenance History / Work Order data
 Logbook data
 Visual Work Place.', 2, '00000000-0000-0000-0000-000000000001', 'Data Sources for Defect Identification', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(106, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 75, '1. Are observations made by technicians, maintainers and operators used to identify defects during execution of work?', '
A process is in place to capture defects through observations and escalate into DE process (as appropriate)
Sources of observation data:
 Direct observation
 Interviews
 Safety interactions
 Floor Tours / Task Analysis.', 3, '00000000-0000-0000-0000-000000000001', 'Observations Leading to Defect Identification', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(107, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 75, '1. Are defects identified using incident reports?
2. What RCA tools are used in incident investigation?
3. How are defects captured from your SHE system transferred to the defect register?', '
A process exists to capture defects identified by incident investigations.', 4, '00000000-0000-0000-0000-000000000001', 'Incident Investigations', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(124, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 78, 'Placeholder', '
Detailed action plans developed with clear accountability.
 Action plans should include:
 Actions
 Accountability
 Targets & deliverables
 Status.', 3, '00000000-0000-0000-0000-000000000001', 'Action Plan', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(108, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 75, '1. Is the DE management team represented by more than just maintenance?
2. Is there an agenda?
3. Is there a structured report or database that is reviewed during the meeting?
4. How are actions captured from the meeting? Are meeting minutes distributed?', '
The Defect Elimination (DE) Management Team meets monthly to identify new DE projects and review current projects? The following functions should be presented in the DE Management Team meeting:
 Operations
 Maintenance
 Logistics.', 5, '00000000-0000-0000-0000-000000000001', 'DE Management Team', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(109, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 75, '1. Is there a process to identify potential defects, and provide solutions prior to occurrence, which have high consequences & very low frequency.
2. Is there a process to identify potential defects from management of change initiatives?
3. What process is used to identify potential defects? Do you use Reliability Block Modelling, FMECA''s etc. to identify future defects?', '
Is there a process in place to identifypotentialdefectsthat have a high consequence and low probability of occuring?', 6, '00000000-0000-0000-0000-000000000001', 'PotentialCriticalDefectIdentification', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(110, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 75, '1. Is there a process to identify future defects in the design phase?
2. How does your site liaise with capital expansion project groups (PDI etc.)?
3. What process is used to identify potential defects? Do you use Reliability Block Modelling, FMECA''s etc. to identify future defects for new equipment?', '
Is there a process in place to identifypotentialdefectsduring the feasibility review and design phases of new projects and equipment?', 7, '00000000-0000-0000-0000-000000000001', 'NewEquipmentDefectIdentification', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(111, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 76, '1. Does the Defect Register identify the value of each potential defect in monetary terms?
2. What models/processes are applied to assessing/prioritising defects?
3. Do you have triggers that require the site to automatically commence an RCA?
4. Is Safety, Health, and Environment (SHE) considered?
5. Is reputation considered?', '
Defects are assessed and prioritised by quantifying the risk and value of eliminating the defect.
Estimates must be made for the following factors:
 Value of eliminating the defect
 Risk the defect poses to the business
 Difficulty in eliminating the defect
 Cost to eliminate defect.', 1, '00000000-0000-0000-0000-000000000001', 'Assess and Prioritise Defects', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(112, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 76, '1. Does the Defect Register include other business improvement initiatives?', '
A Defect Register is used to capture all potential defect projects. This facilitates the prioritisation of defects and the effective allocation of resources.', 2, '00000000-0000-0000-0000-000000000001', 'Defect Register', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(113, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 76, '1. Are  triggers defined/documented for various levels of loss analysis, depending on the severity/impact of the loss?
2. Is a formalised process implemented for front- line personnel to conduct basic RCA''s (e.g. 5- why, etc.)?
3. Is a formalised process implemented for Reliability engineers or maintenance/ops specialists to conduct more complex RCAs for significant/complex losses?
4. Are complex RCA''s are managed as projects?
5. Is a formalised process implemented for Reliability engineers or maintenance/ops specialists to conduct an annual/bi-annual review of significant business losses or accumulating losses not picked up at individual loss event?', '
A decision is made as to whether a team-based approach is necessary or if the defect can be assigned to an individual to "just do it". 
There are agreed triggers to initiate the defect elimination process ', 3, '00000000-0000-0000-0000-000000000001', 'Selection of Process', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(114, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 76, '1. Is there attendance at Defect Elimination team meetings?', '
Teams are selected to work on Defect Elimination projects. The DE Management team must ensure the team is sufficiently resourced.', 4, '00000000-0000-0000-0000-000000000001', 'DE Team Selection', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(115, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 76, '1. Is there an escalation process to ensure that defects impacting multiple sites/departments are considered?', '
The Defect Elimination process is aligned with other Business Improvement initiatives on site? (i.e. MoC, continuous improvement etc).', 5, '00000000-0000-0000-0000-000000000001', 'Process Alignment', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(116, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 76, '1. Are emerging issues identified from the data presented?
2. Are data sources outside of the maintenance sphere used?', '
Undesirable events are analysed in Pareto format and presented at the Monthly DE Management Team meeting.', 6, '00000000-0000-0000-0000-000000000001', 'Data Presentation', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(117, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 77, '1. Are there personnel trained in each of the different tools available?', '
Multiple Root Cause Analysis (RCA) methods are made available to the DE Team and are personnel trained in their use.', 1, '00000000-0000-0000-0000-000000000001', 'Root Cause Analysis (RCA) Methods', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(118, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 77, '1. Is there criteria for what tool or technique will be used?
2. Is the criteria based on actual or potential impact to the business?', '
There are many methods and processes available to assist in the identification of the root causes of a defect.
The specific method chosen will depend on a number of factors:
 Problem complexity
 Risk defect poses
 Problem Dimensions
 If a team is being used.', 2, '00000000-0000-0000-0000-000000000001', 'Selection of RCA method', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(119, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 77, '1. Are team charters developed including problem statements?', '
A Team Charter is developed for each DE Team that includes a clear problem statement.', 3, '00000000-0000-0000-0000-000000000001', 'Problem Statement', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(120, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 77, '1.  How many teams are active and are they comprised of more than just maintenance personnel?', '
Key stakeholders are represented in the Defect Elimination Team to provide input into the problem and solution analysis? Teams should include roles such as:
 Facilitator
 Team Leader
 Reliability Engineer
 Team Members (representing areas effected).', 4, '00000000-0000-0000-0000-000000000001', 'Team Composition', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(121, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 77, '1. Is there an easily accessible database of all RCA''s that have been completed?
2. Does the documentation include photos and conclusions?', '
The RCA documentation is accessible so others in Aurizon may reference them if they have similar issues.', 5, '00000000-0000-0000-0000-000000000001', 'Documentation of RCA', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(122, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 78, '1. Are the teams always focused on getting to the root cause.', '
Are all potential solutions and actions evaluated by the responsible DE Team or individual and are they formally documented?
Solutions and actions have to address the root causes as well as any contributing factors.   ', 1, '00000000-0000-0000-0000-000000000001', 'Identify potential actions', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(123, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 78, '1. Does the owner of the relevant cost centre get to sign off on the actions?
2. Is the evaluation methodology aligned with the site''s Edge evaluation method?', '
All potential actions are evaluated against specific criteria. Actions should be evaluated in terms of:
 Addressing the root cause
 SHE Implications
 Cost to implement
 Ease of implementation.', 2, '00000000-0000-0000-0000-000000000001', 'Evaluation of potential actions', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(126, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 79, '1. Is there a clearly defined process that is documented?', '
Proper approval is obtained for all actions prior to implementation (i.e.: change management).', 1, '00000000-0000-0000-0000-000000000001', 'Approval', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(127, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 79, '1. Does management understand the actions assigned to team members that report to them?', '
Clear accountabilities are established for the completion of the action plan and is it syndicated with management. 
Accountabilities to include:
 Project management
 Action completion
 Action management
 Cost management
 Monitoring progress.', 2, '00000000-0000-0000-0000-000000000001', 'Accountability', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(128, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 79, '1. Are current projects on track?
2. Is allowance made for people to complete their DE actions as well as their other work?', '
The DE Team''s actions and progress reviewed at the monthly DE Management Team meeting. Any slippage in actions must be addressed through additional resources, tools or collaboration.
', 3, '00000000-0000-0000-0000-000000000001', 'Action close out', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(129, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 79, '1. Is there a DE action register for team based activities?
2. Are larger DE activities formally managed as Projects?
3. Are the DE Teams using the DE register to help track their projects?', '
 DE Team progress is tracked using various documents?
 Meeting Minutes
 Who Does What When List (Actions Log)
 Defect Register.', 4, '00000000-0000-0000-0000-000000000001', 'Tracking Progress', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(130, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 80, '1. Has a business process been implemented which defines the following:
 A formalised register/tracker is in place to monitor action status from initiation to closure?
 A post-completion audit is defined to validate the effectiveness of defect elimination actions?
daily/weekly/monthly/annual loss reporting, review and analysis?
 A process is defined to share the learnings across the company but also to vendors and wider industry? ', 'An effective business process should be defined for defect elimination.', 1, '00000000-0000-0000-0000-000000000001', 'Business process for defect elimination', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(131, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 80, '1. Does the agenda for the DE Management Team meeting include time for review of past projects?
2. Does the DE Management Team''s review of current projects focus on KPI''s and targets?', '
The DE Teams should be regularly reporting progress back through to the DE Management Team. ', 2, '00000000-0000-0000-0000-000000000001', 'DE Management Review', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(132, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 80, '1. Are any projects completed in the past year still monitored for sustainability?
2. Are there ever any long term KPI''s allocated to DE projects?', '
The long-term sustainability actions are assured through scheduled reviews of past DE projects. ', 3, '00000000-0000-0000-0000-000000000001', 'Sustainability', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(133, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 80, '1. Is there much awareness about the successful outcome of DE projects throughout the organization?', '
The outcomes of the DE Project are updated in the Defect Register and are the outcomes syndicated? ', 4, '00000000-0000-0000-0000-000000000001', 'Outcomes', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(134, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 80, '1.  Do team members of completed projects feel they are recognized for their efforts?', '
The DE Management Team gives recognition and feedback for success to the DE team members? ', 5, '00000000-0000-0000-0000-000000000001', 'Recognition', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(135, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 81, '1. Are supervisors, planners and technicians aware of the criticality ranking of equipment or systems?
2. Is criticality ranking updated as new changes are made to tactics?
3. Is criticality ranking updated as operational requirements change?', '
Criticality Analysis is important for determining where to focus Asset Tactic Development activities.  Criticality is based on consequence and likelihood.  Categories may include:
 Safety, Health & Environmental
 Costs
 Operational.', 1, '00000000-0000-0000-0000-000000000001', 'Asset Criticality', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(136, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 81, '1. Are supervisors, planners and coordinators aware of the Aurizon Enterprise Risk Management Framework and Appetite?
2. Is Risk rating updated as new changes are made to tactics? Is this communicated to site leadership?
3. Is Risk rating updated as operational requirements change?', '
It is important for determining where to focus Asset Tactic Development activities. Risk Management is based on consequence and likelihood utilising the Aurizon Enterprise Risk Management Framework and Appetite.
Categories may include:
 Safety & Environmental
 Costs
 Operation.', 2, '00000000-0000-0000-0000-000000000001', 'Risk Management', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(137, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 82, '1. Does the database have a logical hierarchy of equipment with a breakdown structure for critical equipment?
2. Does the database contain a listing of common failure modes?', '
A database is important to document analysis and track decision making history. Some other functions of a database are:
 Developing equipment hierarchies & structures
 Statistical Analysis
 Asset Tactic Development database containing common failure mechanisms etc.', 1, '00000000-0000-0000-0000-000000000001', 'Asset Tactic Development Database', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(138, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 82, '1. Is there evidence of tactics review sessions?
2. Are the triggers for review documented?
3. Does the Reliability group report on reviews that have been completed?', '
A process should be in place which will trigger a re-evaluation of tactics.  Triggers for re-evaluation can include:
 Time-Based
 Poor Performance
 Change in conditions
 Defect Elimination
 Change in operating context.', 2, '00000000-0000-0000-0000-000000000001', 'Review of Tactics', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(139, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 82, '1. Are there agendas and action plans available?
2.  Have the recommendations made by previous teams actually made it into the SAP/CMMS system?', '
A team-based approach to Asset Tactic Development will improve the effectiveness of the overall program.  Teams are normally involved in the development & implementation steps:
 Asset Tactic Development analysis
 Data gathering
 Field Validation.', 3, '00000000-0000-0000-0000-000000000001', 'Team-Based Tactics Development', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(140, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 82, '1. Does a prioritized list exist?
2. Does each program have clearly defined boundaries for analysis?
3. Are projects normally of short duration and frequent rather than large and intermittent?', '
Tactics development projects are prioritised and selected based on specific criteria:
 Criticality
 Performance
 Value.', 4, '00000000-0000-0000-0000-000000000001', 'Selection of Projects', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(141, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 82, '1. Do FMECA/RCM/Reverse RCM/PMO based tasks have clearly defined functions, functional failures, failure modes & consequences documented?
2. Was the selected methodology followed to determine the most effective task and interval?
3. Are reasonable failure modes identified?', '
Any tactics development project must include some level of FMECA/RCM/PMO analysis.  Steps involve identifying:
 Functions
 Functional Failures
 Failure Modes
 Failure Effects
 Failure Consequences
 Task Evaluation and Selection (RCM).', 5, '00000000-0000-0000-0000-000000000001', 'FMECA/RCM Process', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(142, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 82, '1.  Is a RACI for tactics development readily available
2.  Does everyone understand their role in the process?
3. Are responsibilities defined as to work content and quality?', '
Key Roles are important for the development and implementation of tactics development analyses and their sustainability. Key Roles are:
 Process Owner 
 Process Champion or Sponsor
 Asset Tactic Development Analyst.', 6, '00000000-0000-0000-0000-000000000001', 'Key Roles', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(143, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 82, '1. Can the training department show evidence of  an active Reliability training program?', '
Suitable Asset Tactic Development methodologies require properly trained and experienced personnel to ensure the effectiveness of the Asset Tactic Development program.  Training should be ongoing and include training plans for:
 Management
 Asset Tactic Development practitioners
 Team Members. ', 7, '00000000-0000-0000-0000-000000000001', 'Tactics development Training', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(144, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 83, '1. Can the organization demonstrate how critical tasks or intervals were determined?', '
It is important to record the decision-making history behind tasks and intervals used in a maintenance strategy.  This will facilitate:
 Review and updating of tactics
 Identifying gaps in information needs.', 1, '00000000-0000-0000-0000-000000000001', 'Decision History', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(145, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 83, '1. Can critical tasks in CMMS be found in the Asset Tactic Development database?
2.  Are critical tasks derived from a FMECA/RCM analysis? ', '
Tasks and associated intervals recorded in a Tactics database should reflect the actual maintenance strategies in use:
 Tasks (and intervals) for critical equipment should exist in the Asset Tactic Development database
 Tasks for critical equipment should have had some level of FMECA/RCM analysis.', 2, '00000000-0000-0000-0000-000000000001', 'Asset Tactic Development-Critical Equipment Tactics', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(146, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 84, '1. Do service sheets have a standard template?
2. Are inspection tasks clearly defined as to what is considered acceptable or not?
3. Are the tasks easily understood?
4. Are critical tasks emphasized in some way?', '
Tasks effectiveness is influenced in how they are presented as service sheets or other such documentation. Documentation guidelines should exist as:
 Standard templates
 Standard terminology
 Clearly defined fields for feedback
 Methods of emphasis.', 1, '00000000-0000-0000-0000-000000000001', 'Document Design', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(147, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 84, '1. Is there a form to validate new service sheets or tasks?
2. Have all safety considerations considered when new tasks are implemented?', '
First time execution of a changed or newly created tactic must be evaluated in the field. Not validating tasks in the field will lead to ineffective tactics and a lack of confidence in the entire program.
Field validation should focus on ensuring:
 Safety, Ergonomic or Environmental issues resolved
 Proper sequencing of tasks
 Equipment access issues
 Identify tools and parts requirements
 Identify training needs.', 2, '00000000-0000-0000-0000-000000000001', 'Field Validation', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(148, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 84, '1. Is there a task packaging function for the Asset Tactic Development database used?
2.  Do tasks have an actual interval less than the derived interval from the FMECA/RCM/Reverse RCM/PMO analysis?', '
Tasks must integrate with the current maintenance program.  Careful consideration must be taken to how tasks are packaged and scheduled in the maintenance program.', 3, '00000000-0000-0000-0000-000000000001', 'Task Packaging', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(149, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 84, '1. Is the ability to change tasks or intervals tightly controlled?
2. Does everybody understand the processes?
3.  Is there a form required before any changes can be made?', '
Change Management procedures are crucial to ensure maintenance tasks & procedures comply with the selected methodology (e.g., RCM, FMECA,  PMO) principles
 Safety
 Materials
 Tasks including specification.', 4, '00000000-0000-0000-0000-000000000001', 'Change Management', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(150, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 85, '1. Are Pareto charts used?
2. Are there reports available comparing expected performance vs revised Asset Tactic Development expected performance?
3.  Is there an active review of failure information for new failure modes?', '
 A continuous process of improving maintenance tactics requires the monitoring of various sources of information on equipment performance and task effectiveness:
 Cost Reports
 Trend Analysis
 Failure Analysis
 Tactics Review
 Defect Elimination
 Integrity Risk Assessment.', 1, '00000000-0000-0000-0000-000000000001', 'Asset Performance Review', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(151, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 85, '1. Have equipment tactics been reviewed to change, eliminate or extend intervals of tasks? Does Senior Management?', '
PMO is a review of equipment performance to determine the effectiveness of tactics already in place and:
 Maybe used for equipment with significant history and well understood life cycles
 Is a method to rapidly review current tactics in bulk.', 2, '00000000-0000-0000-0000-000000000001', 'PMO (Preventative Maintenance  Optimisation)', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(152, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 85, '1. Does Senior Management encourage people to work together on Asset Tactic Development projects?
2. Does Senior Management feel responsible for the performance of the Asset Tactic Development process?', '
Collaboration is important to share information and resources across organizations to help improve Asset Tactic Development outcomes.  Collaboration can come in many forms:
 Asset Management (AM) engagements
 Common Practice Work Groups (CPWGs)
 Multi-Site Projects.', 3, '00000000-0000-0000-0000-000000000001', 'Collaboration', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(153, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 85, '1. Does a Defect Elimination process exist?
2. Are recommendations for tactics improvement from the Defect Elimination process reviewed and incorporated into existing tactics?
3. Are tactics changes generated by the Defect Elimination process reviewed and approved prior to implementation?
4. How often are tactics changed to as an outcome of a DE project? Do you have an example of this?', '        
 A process exists to ensure recommendations for tactics improvement generated from the Defect Elimination process are reviewed and incorporated into existing asset tactics.', 4, '00000000-0000-0000-0000-000000000001', 'Asset Tactics Integrated with Defect Elimination', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(154, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 85, '1. Does Senior Management encourage people to work together on Asset Tactic Development projects?
2. Does Senior Management feel responsible for the performance of the Asset Tactic Development process?', '
Management support is needed to ensure the process is producing results and can continue to improve.', 5, '00000000-0000-0000-0000-000000000001', 'Senior Management Support', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(155, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 85, '1. Is their a schematic or flowchart that accurately reflects the actual process?
2. Is there a comprehensive documented program for Asset Tactic Development?
3. Was the process designed or just developed over time?
4. Are the Asset Tactic Development process schematics referred to when developing the process?', '
To sustainably manage and improve the Asset Tactics the organisation should have a clearly defined and documented Asset Tactics Development (AS&T) process.', 6, '00000000-0000-0000-0000-000000000001', 'The Asset Tactic Development Process', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(156, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 85, '1. Is there a schematic or flowchart that accurately reflects the actual process?
2. How often are Asset Tactics reviewed as a result of information coming out of the post schedule review meeting?
3. Do the maintenance execution teams understand the link between the MBP Improve step and Asset Tactic Development?', '
There should be clearly defined links between the Work Management Analyse Step and Asset Tactic Development to facilitate the review of Tactics identified as possibly not addressing the relevant failure modes. 
This is one of the key maintenance business improvement steps.', 7, '00000000-0000-0000-0000-000000000001', 'Links to Work Management', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(157, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 85, '1. Are modifications to equipment made without maintenance support considerations?
2. Is the concept of modifications well defined?  For example, does it include changes to lubricants or parts specifications?', '
This process will ensure equipment modifications have been reviewed to ensure they will be supported by the maintenance function prior to being operational.', 8, '00000000-0000-0000-0000-000000000001', 'Equipment Modification Review', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(158, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 85, '1. How early in the acquisition phase is the Reliability group consulted?
2. Are equipment specifications requested based on the selected methodology (RCM, FMEA, PMO) analysis?  Safety items, support tooling etc.', '
The Asset Tactic Development process should be an integral part of the acquisition of new equipment:
  Identify costly failure modes
 Ensure maintenance support requirements are met 
  Identify design changes to ensure maintainability
 Determine life cycle expectations
 Develop critical spares listings.', 9, '00000000-0000-0000-0000-000000000001', 'Acquisition of New Equipment', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(159, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 85, '1. How are new technologies monitored?
2. Who looks for new and useful technologies?
3. How often do Tactics get reviewed or updated due to new or previously unknown technologies?', '
Incorporating  new technologies into the current maintenance plan to reduce reliance on physical inspections and calendar-based maintenance is an important part of the Asset Tactic Development Process.
There should be mechanisms in place to prompt a review of Tactics where new or previously unknown technologies are identified.', 10, '00000000-0000-0000-0000-000000000001', 'New Technology', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(160, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 85, '1. Do Reliability Engineers measure the suitability or effectiveness of asset tactics?
2. Are the number of corrective actions resulting from inspections and condition monitoring tasks measured?
3. Are the KPI''s being used to identify where asset tactics require review?', '
The Asset Tactic Development program should increase the reliability and performance of equipment under its governance.  Metrics or KPI''s are established to measure the effectiveness and output of the  Asset Tactic Development process and to identify where Tactics may need to be reviewed. Some measures are: 
 Equipment performance metrics
 Unscheduled work spend
  Cost avoidance
  AR''s completed in a timely manner.', 11, '00000000-0000-0000-0000-000000000001', 'Performance Metrics', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(161, '2025-11-26 09:00:56.002454+00', '2025-11-26 09:00:56.002454+00', 86, '1. How are changes to the Asset Health program tracked. i.e. changed Fmax from 500Hz to 1000Hz?', '', 1, '00000000-0000-0000-0000-000000000001', 'Asset Health information Storage and Sharing
', false, NULL, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
