	(326, '2025-11-26 09:00:56.137731+00', '2025-11-26 09:00:56.137731+00', '00000000-0000-0000-0000-000000000001', 77, 21, 'Complete process that is always followed. Up to date BOM''s used for all maintenance spares purchasing. Complete job Kitting & Staging process that is always followed; Job consolidation for all work is routine, and requires no physical parts confirmation prior to scheduling.', NULL, false, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf'),
