	(348, '2025-11-26 09:00:56.137731+00', '2025-11-26 09:00:56.137731+00', '00000000-0000-0000-0000-000000000001', 82, 23, 'Scheduled hours are consistently scheduled within + or 5% of objective; Resource tracking using SAP, which is used by scheduler and generally accurate. External resources also tracked in the SAP. >80% Schedule Loading for all resources.', NULL, false, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf'),
	(349, '2025-11-26 09:00:56.137731+00', '2025-11-26 09:00:56.137731+00', '00000000-0000-0000-0000-000000000001', 82, 24, 'Scheduled hours are consistently scheduled within 0 or - 5% of target. There is a controlled process for increasing the scheduled resource loading percentage; Precision resource tracking using system functionality, which is used by scheduler.', NULL, false, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf'),
