	(352, '2025-11-26 09:00:56.137731+00', '2025-11-26 09:00:56.137731+00', '00000000-0000-0000-0000-000000000001', 83, 23, 'Minutes and action logs are always updated and shared with all meeting attendees. All of the right roles from Operations and maintenance usually attend the meetings. Key KPI''s, non- conformances and incomplete operations discussed.', NULL, false, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf'),
