	(359, '2025-11-26 09:00:56.137731+00', '2025-11-26 09:00:56.137731+00', '00000000-0000-0000-0000-000000000001', 85, 22, 'Operations are not scheduled unless spares are either on depot/P&E or there is a high degree of certainty that they will be on depot/P&E in time for the scheduled work. There is no role with the specific accountability of managing scheduled spares.', NULL, false, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf'),
	(360, '2025-11-26 09:00:56.137731+00', '2025-11-26 09:00:56.137731+00', '00000000-0000-0000-0000-000000000001', 85, 23, 'Spares are kitted & staged prior to the scheduled date. System is continuously being refined to enable weekly scheduling activities to be based on SAP material lead times to facilitate JIT parts delivery wherever this does not create too much business risk.', NULL, false, 6, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf'),
