	(351, NULL, NULL, NULL, NULL, 'UPDATE', 'measurement_definitions', '43', 'user_action', NULL, NULL, false, '{"id": 43, "name": "Schedule Compliant", "unit": null, "active": false, "provider": "SAP", "max_value": null, "min_value": null, "objective": "To view the effectiveness of the scheduling process and completion of work for the schedule period", "created_at": "2025-09-08T04:19:50.253194+00:00", "deleted_at": null, "is_deleted": false, "updated_at": "2025-09-08T04:19:50.253194+00:00", "calculation": "Schedule Compliant = All Work Orders Completed / All Scheduled Work Orders", "description": "The percentage of the scheduled work that was completed in the last 12 months. Work Order measure by count of work orders completed. Scheduled work is all work orders in the current week with a revision assigned.", "calculation_type": "ratio", "required_csv_columns": [{"name": "completion_date", "data_type": "date", "description": null}, {"name": "revision", "data_type": "string", "description": null}, {"name": "scheduled_start_date", "data_type": "date", "description": null}, {"name": "work_order_id", "data_type": "string", "description": null}, {"name": "work_order_status", "data_type": "string", "description": null}]}', '{"id": 43, "name": "Schedule Compliant", "unit": null, "active": false, "provider": "SAP", "max_value": 1, "min_value": 0, "objective": "To view the effectiveness of the scheduling process and completion of work for the schedule period", "created_at": "2025-09-08T04:19:50.253194+00:00", "deleted_at": null, "is_deleted": false, "updated_at": "2025-09-08T04:19:50.253194+00:00", "calculation": "Schedule Compliant = All Work Orders Completed / All Scheduled Work Orders", "description": "The percentage of the scheduled work that was completed in the last 12 months. Work Order measure by count of work orders completed. Scheduled work is all work orders in the current week with a revision assigned.", "calculation_type": "ratio", "required_csv_columns": [{"name":