	(352, NULL, NULL, NULL, NULL, 'UPDATE', 'measurement_definitions', '44', 'user_action', NULL, NULL, false, '{"id": 44, "name": "Preventive Work Effectiveness", "unit": null, "active": false, "provider": "SAP", "max_value": null, "min_value": null, "objective": "To view the effectiveness of scheduled preventative and corrective work in identifying corrective work to ensure the asset can be utilised between maintenance periods and break-in work is minimised.", "created_at": "2025-09-08T04:19:50.546412+00:00", "deleted_at": null, "is_deleted": false, "updated_at": "2025-09-08T04:19:50.546412+00:00", "calculation": "Preventative Work Effectiveness = All Corrective Work Orders with Status FOO from Scheduled Work / All Work Orders Closed", "description": "The percentage of corrective work with status FOO, identified from scheduled preventative and corrective work measured over all closed work orders in the last 12 months. Work orders are a measure by count.", "calculation_type": "ratio", "required_csv_columns": [{"name": "completion_date", "data_type": "date", "description": null}, {"name": "work_order_id", "data_type": "string", "description": null}, {"name": "work_order_status", "data_type": "string", "description": null}, {"name": "work_order_type", "data_type": "string", "description": null}]}', '{"id": 44, "name": "Preventive Work Effectiveness", "unit": null, "active": false, "provider": "SAP", "max_value": 1, "min_value": 0, "objective": "To view the effectiveness of scheduled preventative and corrective work in identifying corrective work to ensure the asset can be utilised between maintenance periods and break-in work is minimised.", "created_at": "2025-09-08T04:19:50.546412+00:00", "deleted_at": null, "is_deleted": false, "updated_at": "2025-09-08T04:19:50.546412+00:00", "calculation": "Preventative Work Effectiveness = All Corrective Work Orders with Status FOO from Scheduled Work / All Work Orders Closed", "description": "The percentage of corrective work wit