	(353, NULL, NULL, NULL, NULL, 'UPDATE', 'measurement_definitions', '45', 'user_action', NULL, NULL, false, '{"id": 45, "name": "Asset Handover Effectiveness (Future)", "unit": null, "active": false, "provider": "other", "max_value": null, "min_value": null, "objective": "To view the time that the asset is idol, albeit productively or non-productively. It provides an overall measure of how well delivery of the Asset and handover is done between Maintenance and Operations.", "created_at": "2025-09-08T04:19:50.855791+00:00", "deleted_at": null, "is_deleted": false, "updated_at": "2025-09-08T04:19:50.855791+00:00", "calculation": "Asset Handover Effectiveness = Asset Handover Time / Total of Asset Handover and Maintenance Downtime Time", "description": "Asset Handover Effectiveness is defined as the percentage of calendar time that the asset was not operating before maintenance begun", "calculation_type": "ratio", "required_csv_columns": [{"name": "asset_id", "data_type": "string", "description": null}, {"name": "handover_start_time", "data_type": "date", "description": null}, {"name": "maintenance_end_time", "data_type": "date", "description": null}, {"name": "maintenance_start_time", "data_type": "date", "description": null}]}', '{"id": 45, "name": "Asset Handover Effectiveness (Future)", "unit": null, "active": false, "provider": "other", "max_value": 1, "min_value": 0, "objective": "To view the time that the asset is idol, albeit productively or non-productively. It provides an overall measure of how well delivery of the Asset and handover is done between Maintenance and Operations.", "created_at": "2025-09-08T04:19:50.855791+00:00", "deleted_at": null, "is_deleted": false, "updated_at": "2025-09-08T04:19:50.855791+00:00", "calculation": "Asset Handover Effectiveness = Asset Handover Time / Total of Asset Handover and Maintenance Downtime Time", "description": "Asset Handover Effectiveness is defined as the percentage of calendar time that the asset was not operati