	(355, NULL, NULL, NULL, NULL, 'UPDATE', 'measurement_definitions', '47', 'user_action', NULL, NULL, false, '{"id": 47, "name": "Unplanned Work Orders (Manual)", "unit": null, "active": false, "provider": "SAP", "max_value": null, "min_value": null, "objective": "To view total amount of work orders that are not planned ready for scheduling and execution. It indicates how effectively Maintenance is keeping up with the volume of work being generated with the resources available.", "created_at": "2025-09-08T04:19:51.449671+00:00", "deleted_at": null, "is_deleted": false, "updated_at": "2025-09-08T04:19:51.449671+00:00", "calculation": "Unplanned Work Orders = Unplanned Work Orders / All Work Orders", "description": "A summation count of all work orders not planned in back and forward scheduling periods divided by the summation count of all work orders grouped by the work order start date.", "calculation_type": "ratio", "required_csv_columns": [{"name": "revision", "data_type": "string", "description": null}, {"name": "work_order_id", "data_type": "string", "description": null}, {"name": "work_order_start_date", "data_type": "date", "description": null}, {"name": "work_order_status", "data_type": "string", "description": null}]}', '{"id": 47, "name": "Unplanned Work Orders (Manual)", "unit": null, "active": false, "provider": "SAP", "max_value": 1, "min_value": 0, "objective": "To view total amount of work orders that are not planned ready for scheduling and execution. It indicates how effectively Maintenance is keeping up with the volume of work being generated with the resources available.", "created_at": "2025-09-08T04:19:51.449671+00:00", "deleted_at": null, "is_deleted": false, "updated_at": "2025-09-08T04:19:51.449671+00:00", "calculation": "Unplanned Work Orders = Unplanned Work Orders / All Work Orders", "description": "A summation count of all work orders not planned in back and forward scheduling periods divided by the summation count of all work orders groupe