	(357, NULL, NULL, NULL, NULL, 'UPDATE', 'measurement_definitions', '51', 'user_action', NULL, NULL, false, '{"id": 51, "name": "Planned Equipment Availability (Future)", "unit": null, "active": false, "provider": "other", "max_value": null, "min_value": null, "objective": "To view how maintenance work in the future integrates with the operation plans which is reflected by predicting availability of equipment after scheduled maintenance.", "created_at": "2025-09-08T04:19:52.670788+00:00", "deleted_at": null, "is_deleted": false, "updated_at": "2025-09-08T04:19:52.670788+00:00", "calculation": "Equipment Availability = (Calendar Time - Total Hours Future Work Orders) / Calendar Time", "description": "The percentage of calendar time that assets are physically available for work. Calendar time 1440 mins per day and all measurements are to be taken over same period", "calculation_type": "ratio", "required_csv_columns": [{"name": "asset_id", "data_type": "string", "description": null}, {"name": "calendar_time", "data_type": "number", "description": null}, {"name": "total_hours_future_work_orders", "data_type": "number", "description": null}]}', '{"id": 51, "name": "Planned Equipment Availability (Future)", "unit": null, "active": false, "provider": "other", "max_value": 1, "min_value": 0, "objective": "To view how maintenance work in the future integrates with the operation plans which is reflected by predicting availability of equipment after scheduled maintenance.", "created_at": "2025-09-08T04:19:52.670788+00:00", "deleted_at": null, "is_deleted": false, "updated_at": "2025-09-08T04:19:52.670788+00:00", "calculation": "Equipment Availability = (Calendar Time - Total Hours Future Work Orders) / Calendar Time", "description": "The percentage of calendar time that assets are physically available for work. Calendar time 1440 mins per day and all measurements are to be taken over same period", "calculation_type": "ratio", "required_csv_columns": [{"name": "asset_id", "data_type": "string", "description": null}, {"name": "calendar_time", "data_type": "number", "description": null}, {"name": "total_hours_future_work_orders", "data_type": "number", "description": null}]}', '{max_value,min_value}', '{"ip": null, "user_agent": null, "soft_delete_at": null}', '2025-11-05 02:46:48.001249+00'),
	(358, NULL, NULL, NULL, NULL, 'UPDATE', 'measurement_definitions', '52', 'user_action', NULL, NULL, false, '{"id": 52, "name": "Break-In Work Ratio", "unit": null, "active": true, "provider": "SAP", "max_value": null, "min_value": null, "objective": "The break-in work ratio measures the distribution of the maintenance work by showing the type of work that maintenance resources are executing.", "created_at": "2025-09-08T04:19:52.924363+00:00", "deleted_at": null, "is_deleted": false, "updated_at": "2025-09-08T04:19:52.924363+00:00", "calculation": "Break-In Work Ratio = Total Number of Break-In Work Orders Completed / Total Number of Work Orders Completed", "description": "The ratio of the break-in maintenance work to the total maintenance work based on work order count calculated over the same period.", "calculation_type": "ratio", "required_csv_columns": [{"name": "completion_date", "data_type": "date", "description": null}, {"name": "work_order_id", "data_type": "string", "description": null}, {"name": "work_order_status", "data_type": "string", "description": null}, {"name": "work_order_type", "data_type": "string", "description": null}]}', '{"id": 52, "name": "Break-In Work Ratio", "unit": null, "active": true, "provider": "SAP", "max_value": 1, "min_value": 0, "objective": "The break-in work ratio measures the distribution of the maintenance work by showing the type of work that maintenance resources are executing.", "created_at": "2025-09-08T04:19:52.924363+00:00", "deleted_at": null, "is_deleted": false, "updated_at": "2025-09-08T04:19:52.924363+00:00", "calculation": "Break-In Work Ratio = Total Number of Break-In Work Orders Completed / Total Number of Work Orders Completed", "description": "The ratio of the break-in maintenance work to the total maintenance work based on work order count calculated over the same period.", "calculation_type": "ratio", "required_csv_columns": [{"name": "completion_date", "data_type": "date", "description": null}, {"name": "