	(362, NULL, NULL, NULL, NULL, 'UPDATE', 'measurement_definitions', '56', 'user_action', NULL, NULL, false, '{"id": 56, "name": "Preventive Work Profile", "unit": null, "active": false, "provider": "SAP", "max_value": null, "min_value": null, "objective": "To view the ratio of Preventative work against Corrective work. It provides an indication of how much work is proactive and scheduled to assure Asset capability.", "created_at": "2025-09-08T04:19:54.156811+00:00", "deleted_at": null, "is_deleted": false, "updated_at": "2025-09-08T04:19:54.156811+00:00", "calculation": "Preventative Schedule Work = Preventative Work Orders / All Work Orders", "description": "Preventative work orders measured against total of all Preventative and Corrective work orders over a period. Period will be measured over the same time frame", "calculation_type": "ratio", "required_csv_columns": [{"name": "completion_date", "data_type": "date", "description": null}, {"name": "work_order_id", "data_type": "string", "description": null}, {"name": "work_order_status", "data_type": "string", "description": null}, {"name": "work_order_type", "data_type": "string", "description": null}]}', '{"id": 56, "name": "Preventive Work Profile", "unit": null, "active": false, "provider": "SAP", "max_value": 1, "min_value": 0, "objective": "To view the ratio of Preventative work against Corrective work. It provides an indication of how much work is proactive and scheduled to assure Asset capability.", "created_at": "2025-09-08T04:19:54.156811+00:00", "deleted_at": null, "is_deleted": false, "updated_at": "2025-09-08T04:19:54.156811+00:00", "calculation": "Preventative Schedule Work = Preventative Work Orders / All Work Orders", "description": "Preventative work orders measured against total of all Preventative and Corrective work orders over a period. Period will be measured over the same time frame", "calculation_type": "ratio", "required_csv_columns": [{"name": "completion_date", "data_type": "date", "descr