	(363, NULL, NULL, NULL, NULL, 'UPDATE', 'measurement_definitions', '57', 'user_action', NULL, NULL, false, '{"id": 57, "name": "On Time Material Delivery (Manual DIFOT)", "unit": null, "active": false, "provider": "SAP", "max_value": null, "min_value": null, "objective": "To view inventory efficiency for delivery of materials when required for maintenance. It is an indicator of how supply is meeting maintenance demand in terms of the requested delivery date.", "created_at": "2025-09-08T04:19:54.450173+00:00", "deleted_at": null, "is_deleted": false, "updated_at": "2025-09-08T04:19:54.450173+00:00", "calculation": "On Time Material Delivery = Total Materials Meet Required Date / Total All Materials", "description": "Materials required ordered date is compared to the actual delivery time and measured as a percentage that meet the required date.", "calculation_type": "ratio", "required_csv_columns": [{"name": "delivery_date", "data_type": "date", "description": null}, {"name": "material_id", "data_type": "string", "description": null}, {"name": "required_date", "data_type": "date", "description": null}]}', '{"id": 57, "name": "On Time Material Delivery (Manual DIFOT)", "unit": null, "active": false, "provider": "SAP", "max_value": 1, "min_value": 0, "objective": "To view inventory efficiency for delivery of materials when required for maintenance. It is an indicator of how supply is meeting maintenance demand in terms of the requested delivery date.", "created_at": "2025-09-08T04:19:54.450173+00:00", "deleted_at": null, "is_deleted": false, "updated_at": "2025-09-08T04:19:54.450173+00:00", "calculation": "On Time Material Delivery = Total Materials Meet Required Date / Total All Materials", "description": "Materials required ordered date is compared to the actual delivery time and measured as a percentage that meet the required date.", "calculation_type": "ratio", "required_csv_columns": [{"name": "delivery_date", "data_type": "date", "description": null}, {"name": "m