	(746, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '61', 'user_action', NULL, NULL, false, NULL, '{"id": 61, "title": "Work Identification Training", "context": "Operators / maintainers / Maint professionals / contractors receive training in Work Identification and Notification creation, considering:\n Work identification is incorporated into new employees training\n Sources of training materials may be:\no > Site-specific Work Identification training\no > Work Identification Awareness presentation\no > SAP raising notification training.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 1, "question_text": "1. How are new employees being trained in Work Identification and Notification creation?\n2. Have Operators (if applicable, e.g.. inspection routes) and Maintainers received Work Identification training?\n3. Are there any training gaps in your organization regarding entering a work request into your SAP?\n4. Have Service Providers / contractors received Work Identification training?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 69}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(747, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '62', 'user_action', NULL, NULL, false, NULL, '{"id": 62, "title": "Identification of PM work", "context": "PM Work has a defined scope and frequency, and originates from the asset maintenance strategy, and built into its maintenance tactics. The maintenance tactics are a set of activities carried out to enable the realisation of the defined reliability/availability of the Asset. All maintenance strategies and tactics are created within the SAP for automatic generation as PM01\n", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 2, "question_text": "1.  Is all of the PM Work set up within the SAP?\n2.  Is most of the PM work calendar-based, and/or based on OEM recommendations, rather than tactics reviews? \n3.  For new equipment, is PM Work  based on formal Asset Tactics Development?  What is the process for entering them into the SAP? \n4.   What is the process for modifications to existing tactics, and entering them into the SAP?   How often are formal reviews undertaken?\n5. Preventative work orders are part of the maintenance regime (PM02)", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 69}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(855, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '170', 'user_action', NULL, NULL, false, NULL, '{"id": 170, "title": "Asset Health Equipment Calibration \n", "context": "", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 4, "question_text": "Placeholder", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 87}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(748, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '63', 'user_action', NULL, NULL, false, NULL, '{"id": 63, "title": "Inspection Checklist Design - Operators", "context": "Operator inspection checklists are up-to-date and aligned with equipment maintenance strategy. (Daily, Weekly, Monthly). Defects found as a result are entered in the SAP in a timely manner considering:\n Safety\n Materials\n Tasks including specification\n Additional Resources\n Feedback / comments field\n Sign off.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 3, "question_text": "1. Are there Operators'' checklists for all equipment? (Note this refers to inspection checklists, not merely pre-op inspection forms).\n2. Is there alignment with the checklist details and the maintenance strategies? How are changes to inspection requirements and strategies transferred to the checklist? \n3. All are all defects entered as Notifications in the SAP in a timely manner?\n4. Do Notifications typically represent all aspects of the true condition of the equipment?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 69}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(749, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '64', 'user_action', NULL, NULL, false, NULL, '{"id": 64, "title": "Inspection Checklist Design - Maintainers", "context": "Inspection checklists are up-to-date and aligned with equipment maintenance strategy. (Daily, Weekly, Monthly) considering:\n Safety\n Materials\n Tasks including specification\n Additional Resources\n Feedback / comments field\n Sign off.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 4, "question_text": "1. When inspection checklists are performed by maintainers, are defects found entered in the SAP?\n2. Is there alignment with the checklist details and the maintenance strategies?\n3. How are changes to inspection requirements and strategies transferred to the checklist? \n4. Are defects found as a result of inspections scheduled using the standard Maintenance Planning Process, or executed as part of \"scheduled\" work?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 69}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(750, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '65', 'user_action', NULL, NULL, false, NULL, '{"id": 65, "title": "Maintenance Request / Notification Process", "context": "All work requests are  recorded in the SAP as Notifications. This includes identifying work found as a result of  Reliability inspections.  \nAdequate information to process the notification is included:\n   What:   A description of the fault or request for maintenance, including any troubleshooting performed\n  Where:  Identifies the maintainable item requiring maintenance\n  When:   Pinpoints when the fault occurred and sets the priority for the task \nto be performed\n  Why:  Relates why the work need to be performed (failure modes)\n", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 5, "question_text": "1. Are notifications written in a timely manner, to the appropriate level of maintainable item in the hierarchy and with sufficient detail to process?\n2. Are all defects being captured in SAP and are notifications written to the appropriate level of maintainable item in the equipment hierarchy?\n3. Are notifications written which capture accurate failure modes?\n4. What ratio of Notifications are being generated by operations and maintenance?\n5. Are notifications being reviewed and screened daily to insure all valid items are addressed?\n6. Corrective work orders (PM01) are generated by RDC, by condition monitoring processes, as follow-on work orders from preventative work or modifications via change management committee", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 69}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(751, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '66', 'user_action', NULL, NULL, false, NULL, '{"id": 66, "title": "Work Request / Notification Priority", "context": "Priorities of work being performed must be determined based on set guidelines and in line with maintenance and operational requirements.\n", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 6, "question_text": "1. How are priorities currently being determined?\n2. Do operations and maintenance superintendents/supervisors discuss and negotiate priorities?\n3. Are priorities set based on equipment criticalities?\n4. Does the planner work from the prioritised work list?\n5. Capital work orders (PM03) are generated as part of the maintenance regime and are associated with specific items", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 69}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(752, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '67', 'user_action', NULL, NULL, false, NULL, '{"id": 67, "title": "Work Request / Notification Review", "context": "For effective planning of maintenance tasks, Operations, Maintenance and Service providers must review Notifications on a regular basis, and ensure that incorrectly coded notifications are recoded for processing.\n", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 7, "question_text": "1. Do operations use SAP to understand their area''s asset health?\n2. Do planners and area team leaders look outside their regular parameters to check for incorrectly coded Notifications that have \"fallen through the cracks\"?\n3. Do Notifications rejected for more information obtain the follow-up required?\n4. Are Notifications checked for duplicate entries within the SAP?  Do notifications get reviewed and approved prior to WO creation?\n5. Are job requests being reviewed for urgency, quality of job information, assignment to correct productive unit and work centre and then approved/actioned in a timely manner? ", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 69}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(875, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '190', 'user_action', NULL, NULL, false, NULL, '{"id": 190, "title": "Report-format\n", "context": "", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 6, "question_text": "1. How are the Asset Health personnel held accountable?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 91}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(753, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '68', 'user_action', NULL, NULL, false, NULL, '{"id": 68, "title": "Representative of Equipment Condition", "context": "The ultimate aim of the identify step is to ensure that the ACTUAL condition of the equipment is captured in the SAP.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 8, "question_text": "1. Are all known equipment faults or issues recorded in the SAP through the formal process?\n2. Is the majority of work done during a maintenance event known about in advance and captured in the system?\n3. If a detailed inspection was done on a piece of equipment how many of the faults / issues found would already be in the SAP?\n4. Are predictive/condition based technologies used to identify maintenance?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 69}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(754, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '69', 'user_action', NULL, NULL, false, NULL, '{"id": 69, "title": "Identify Improvement Work", "context": "Improvement work may flow in from a number of sources: \n Environment, health, safety and community relations\n Incident investigations\n Reliability analyses\n Defect elimination investigations\n Operation uptime initiatives\n Cost reduction analyses\n Asset life cycle plan.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 9, "question_text": "1. Is any work coded as Improvement work?\n2.  Is Improvement work evaluated prior to progressing to planning/scheduling/execution, etc.?\n3.  Is the MOC process followed for Improvement work?\n4.  Are risk assessments and cost analysis performed prior to progressing?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 69}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(755, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '70', 'user_action', NULL, NULL, false, NULL, '{"id": 70, "title": "Identify Additional Work Found During Work Execution", "context": "Subsequent, or related, notifications can be coded as such in the SAP.  Some items to note:\n  A subsequent notification should be created if additional work is discovered while performing a task on a work order.\n  The original work order can be categorized as any type of maintenance work.  However, subsequent notifications are most often found while performing PM work.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 10, "question_text": "1. Are subsequent notifications being created?\n2. Is the information used to improve the maintenance strategies?\n3. Do high level PM''s exist that allow corrective work to be completed without raising a subsequent notification?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 69}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(756, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '71', 'user_action', NULL, NULL, false, NULL, '{"id": 71, "title": "Scoping Work", "context": "To ensure that the planning function is performed in the same manner all the time, well document planning standards for work orders and work management must be in place and followed:\n Workshop visits by planners during planning of major tasks\n Task frequencies and durations captured\n All resource, materials, shared equipment requirements captured\n Safety requirements determined and captured\n Validity of Task reviewed in relation to Tactics\n Additional documentation (checklists) attached\n", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 1, "question_text": "1. Has the Aurizon Maintenance Planning Process been communicated and made available to all?\n2. Is current planning performed as per the Aurizon Maintenance Planning Process?  As applicable, do job scopes include clean-up, decon requirements, and rotables information?\n3. Parts availability is being verified before scheduling of tasks?\n4. Are Tasks rejected which don''t comply with current equipment tactics, or rescoped to align with Budget, Tactics, operations and or Equipment stability requirements?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 70}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(757, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '72', 'user_action', NULL, NULL, false, NULL, '{"id": 72, "title": "Long Term Planning Horizons & Tasks", "context": "Capital Planning tasks are managed by Long Term Planning (26 weeks to 3 weeks).  Clear differentation of maintenance tasks required to assign maintenance planner form Asset Managament & Startegy or Business Unit.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 2, "question_text": "1. Long Term Planning (LTP) develops plans for Preventative and Capital work >26 weeks\n2. Depot Planning receives handover from LTP and is responsible within 26 weeks for Preventative, Corrective and all other work order types until handover to Depot Scheduler at 3 weeks\n3. LTP and Capital Planner is responsible within 26 weeks for Capital Work\n4. Handover from LTP to Depot Planner occurs at 26 weeks on a rolling monthly basis", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 70}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(797, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '112', 'user_action', NULL, NULL, false, NULL, '{"id": 112, "title": "Defect Register", "context": "\nA Defect Register is used to capture all potential defect projects. This facilitates the prioritisation of defects and the effective allocation of resources.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 2, "question_text": "1. Does the Defect Register include other business improvement initiatives?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 76}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(758, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '73', 'user_action', NULL, NULL, false, NULL, '{"id": 73, "title": "Task List / Standard Jobs", "context": "To reduce the amount of work, and support continuous improvement, standard jobs or task lists should be used during the planning process.\nA Job should only ever be planned once, saved as a task list or standard job, and then improved over time.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 3, "question_text": "1. How many task lists are available?  What % of work (PM, corrective & breakdown) is created from task lists or standard jobs?\n2. Are the task lists that are available used including ordering of required material for jobs? \n3. Is there are formal process to update and create new tasks lists? \n4. Are task list instructions detailed with specification or are they \"Is motor hot?\" or \"Check Alignment\"? ", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 70}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(759, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '74', 'user_action', NULL, NULL, false, NULL, '{"id": 74, "title": "Backlog / Forward Log Work Management", "context": "To enable effective loading of scheduled maintenance tasks, the Workload must be consistently updated, accurate, and include:\n No duplicate tasks and no standing work orders\n Resource requirements including contractors and support equipment\n Task durations\n Intended start date, in the future\n Priorities set.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 4, "question_text": "1. Is the concept of backlog, forward log and future log understood?\n2. Does the forward log reflect the actual next available down-time condition of the equipment?\n3. How often is the backlog being managed and by whom?\n4. Is equipment criticality taken into consideration during the Planning process and workload reviews?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 70}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(760, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '75', 'user_action', NULL, NULL, false, NULL, '{"id": 75, "title": "SAP Management", "context": "The SAP must be actively managed to ensure the Work Management process works properly and efficiently, and data is available for later reliability analysis. Data requiring management may include:\n Proper work order coding with regards to user statuses\n Differentiating warranty work\n Install / Dismantle of equipment (rotables)\n Review of job plans requiring complex planning\n", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 5, "question_text": "1. What percentage of work orders are planned with a complex task (operations) structure?\n2. Is data such as master warranties and equipment install/dismantles entered and updated in a timely manner?\n3. Do the majority of planners only enter and manage data in the minimum required fields?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 70}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(761, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '76', 'user_action', NULL, NULL, false, NULL, '{"id": 76, "title": "Work Packages", "context": "Before work commences, and to allow for effective execution of the planned work, maintainers must be provided with a complete work package.  Depending on the size/duration/complexity of the job, a work package may be a binder, or simply a printed job card (shop paper).\nWork Packs should include:\n Start-up, test, demob and clean-up requirements including return of unused parts and repairables\n Materials listing\n Space for feedback\n Gantt charts (if applicable) \n", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 6, "question_text": "1. Do planners understand the essential information required in a work package?\n2. Are the work packages prepared and available before the scheduled work period?\n3. Do work packages require frequent modifications or do they adequately detail the required work?\n4. Are work packages with multiple work orders used and when?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 70}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(762, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '77', 'user_action', NULL, NULL, false, NULL, '{"id": 77, "title": "Material Management - Process", "context": "\nAn effective parts management process incorporates the following criteria. \n Up to date Bill of Material (BOM''s) & inventory levels          \n Parts ordered from BOM''s, or updated if not\n Correct requisitioning, to the correct work order and use of lead times\n Effective Planner / Warehouse communications\n Parts tracking monitored                                                                                                         Use of Materials Availability reporting, if available\n ", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 7, "question_text": "1. Are ordered parts on site in time to schedule work orders?\n2. What portion of parts are on site JIT for the maintenance activity?\n3. What portion of parts are returned for poor quality or incorrect parts delivered?  Are left-over parts returned on a timely basis?\n4. Are BOM''S on the system up to date and used?\n5. Have all requisitioners been trained on requisitioning procedures and SAP system? (for example, checking lead-times, setting delivery dates, correct cost assignment)", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 70}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(763, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '78', 'user_action', NULL, NULL, false, NULL, '{"id": 78, "title": "Material Management - Kitting & Staging", "context": "\nAn effective job consolidation process incorporates the following criteria. \n Job consolidation (kitting and staging) occurs                         Clearly marked bins\n In time delivery and staging\n Complete and correct parts\n Work order number, req number & materials listing displayed\n Located close to work area\n", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 8, "question_text": "1. Is there a heavy reliance on use of on-site bin-stock, such that supervisors or maintainers are kitting their own work?\n2. Are staged parts in clearly marked bins with the work order identified?\n3. How often are parts missing in the bins  or parts incomplete?\n4. Is everyone aware of the staging process?\n5. How many days in advance are parts kitted and staged for execution?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 70}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(764, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '79', 'user_action', NULL, NULL, false, NULL, '{"id": 79, "title": "Roles / Responsibilities", "context": "\nPlanners should remain focused on planning future work, without distraction from supervision tasks, or managing breakdowns and interrupt work, and associated emergency parts procurement.\n", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 9, "question_text": "1. What percentage of a planner''s time is spent actually planning future work?\n2. Do planners act as \"parts chasers\"?  Are they expediters or planners?\n3. Are planners doing most of the planning for Urgent breakdown work?\n4. Are BU planners required to ''fix'' planning gaps for capital works?\n", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 70}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(765, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '80', 'user_action', NULL, NULL, false, NULL, '{"id": 80, "title": "Long Term Scheduling Time Horizons", "context": "\nLong term, rough-cut schedules must be developed to assist with budgeting and co-coordinating of major maintenance shutdowns and other significant events affecting operations planning and consider:\n Rough-cut capacity scheduling is a key element of forward log maintenance planning\n Maintenance and operations schedules are integrated\n", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 1, "question_text": "1. How far in the future is the rough-cut schedule developed and documented?\n2. Is the rough-cut schedule regularly reviewed with Operations? How far in the future?\n3. Does the rough-cut schedule take the operations schedule into account ?\n4. Are there any measures in place or reporting undertaken to ensure this process is followed?\n\nIs the long-termplanning horizon long enough to allow for effective resource planning and an integrated maintenance and operations plan?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 71}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(766, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '81', 'user_action', NULL, NULL, false, NULL, '{"id": 81, "title": "Available Resources", "context": "\nEffective scheduling of work requires control of resources including contractors utilising the following:\n Leave guidelines\n Training guidelines and/or competencies\n Use of available system functionality (preferable),\n Use of manual resource tracking tool\n Alliance contractor work centres are set-up and managed\n", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 2, "question_text": "1. How are non-maintenance activities (training) managed?  Are there any standing work orders used for scheduling?\n2. Is there a formal process for forecasting and reviewing the need for additional resources?\n3. Are the work centre capacities (available man-hours) managed weekly for internal resources and alliance contractors?\n4. Is system functionality for resource tracking used to its fullest extent?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 71}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(767, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '82', 'user_action', NULL, NULL, false, NULL, '{"id": 82, "title": "Schedule Resource Loading", "context": "\nSome guidelines for effective utilization of all resources must be communicated and followed and include:\n No standing work orders used\n Loading per person per week in hours\n Non-maintenance activities are deducted from available hours\n Work centre resource management\n Review of KPI''s to determine proper schedule loading\n", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 3, "question_text": "1. Are the guidelines determined and documented?  Have these been communicated and aligned with current metrics?\n2.  Does the amount of people available drive what work is scheduled, rather than what work is required drives determines how many resources are scheduled?\n3. Is work order resource planning adequate to enable scheduling of available resources?\n4. What percent of available resources are scheduled on a weekly basis?\n5. Is reporting on Resource Utilization and Use of Resource Availability reviewed regularly?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 71}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(880, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_rating_scales', '21', 'user_action', NULL, NULL, false, NULL, '{"id": 21, "name": "Level 1", "value": 1, "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.110871+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.110871+00:00", "description": "Imported scale level 1", "order_index": 0, "questionnaire_id": 6}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.110871+00'),
	(768, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '83', 'user_action', NULL, NULL, false, NULL, '{"id": 83, "title": "Scheduling Review/Lock in Meetings", "context": "There should be formal ''schedule'' meetings.\n Operations and maintenance sit down to discuss the proposed schedule. This is done in tandem with the operations schedule. Any active discussions regarding schedule inclusions should happen at this meeting.\n The teams get back together to formally lock down the schedule. This discussion should be a formality and should rarely involve disagreements on the schedule inclusions. The timing of the second meeting is usually dictated by the lock-down date in the SAP.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 4, "question_text": "1. Are there a regular scheduling meetings?\n2. Do the right people attend?\n3. Is the scheduling meeting agenda followed, is there a meeting chair and are minutes taken for distribution?\n4. Are improvement actions being assigned weekly? Is there an Actions Log?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 71}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(769, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '84', 'user_action', NULL, NULL, false, NULL, '{"id": 84, "title": "Scheduling of Maintenance Strategies/Tactics", "context": "Identified Maintenance strategies/tactics (Corrective & Breakdown) represent work required to increase the reliability of the equipment.  This work should be given high priority when creating the schedule.\nConsiderations include:\n Breakdown jobs given high priority\n Work order priorities for including work in schedule\n", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 5, "question_text": "1. Does break-in work often take the place of primary work?\n 2. Are maintenance strategies set up in SAP to trigger work orders at recommended intervals?\n3. Is including of secondary and breakdown work in the schedule based on priorities and criticality?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 71}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(770, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '85', 'user_action', NULL, NULL, false, NULL, '{"id": 85, "title": "Material Management - Scheduled Spares", "context": "Best practice would see materials managed using a Just-in-Time philosophy. This minimises stocked inventory and, in turn costs. However, particularly for isolated depot/P&Es with potential supply chain logistics issues, this is not always practical.\nIt is accepted that, in order to reduce the risks presented by these issues Aurizon depot/P&Es should be protecting their maintenance schedules by ensuring spares and materials are on depot/P&E before the Operations are scheduled.\n", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 6, "question_text": "1. Are scheduled spares consolidated in a staging area prior to the scheduled activity?\n2. Is there a role allocated (e.g., Scheduled Spares Coordinator) to managing Scheduled Spares?\n3. Are spares being checked prior to the job being scheduled and is the material tracking report used for this?\n4. How often are scheduled jobs called off due to the spares not being on depot/P&E, or the wrong spares having been ordered or delivered?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 71}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(771, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '86', 'user_action', NULL, NULL, false, NULL, '{"id": 86, "title": "Weekly Schedule (Quality) Output", "context": "\nPriorities of work to be determined based on set guidelines and in line with maintenance and operations requirements considering:\n Input based on operations objectives\n Safety / Environmental priorities\n Support equipment availability\n Possible contingency plans                                        \n Review of Materials availability                                 \n Schedule needs to be agreed & confirmed                          \n Work packages and/or job cards are part of published schedule \n", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 7, "question_text": "1. Is there a formal weekly scheduling meeting and are operations, service departments and contractors consulted when developing schedules?\n2. When is the schedule committed or Snapshot performed and how far in advance of the snapshot is weekly schedule completed?\n3.  Do schedules often change after they are agreed to?\n4. Is the scheduling of PM''s based on the outstanding work hours and not a fixed downtime duration? (12 hours every PM)\n5. Is there a formal post-mortem review meeting, and action items assigned and completed in a reasonable time?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 71}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(772, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '87', 'user_action', NULL, NULL, false, NULL, '{"id": 87, "title": "Daily Shift Start / Shift Handover", "context": "\nTo create awareness for oncoming crews an effective handover / turnover process must be in place and address the following:\n Participated by all relevant personnel\n Current progress on planned work\n Possible operations requirements during shift\n Causes for delays, if any\n Changes in environment / risks\n Additional faults / defects found\n Work packages handed out and reviewed as required", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 1, "question_text": "1. Are critical jobs and/or tasks handled differently?\n2. Are additional faults/defects identified during the course of work not completed due to lack of communications between shifts?\n3. Are delay causes identified and relayed to oncoming crews?\n4. How well prepared are the oncoming crew members when they leave their shift start briefing?\n5. Are improvement actions captured during the shift start meetings?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 72}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(773, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '88', 'user_action', NULL, NULL, false, NULL, '{"id": 88, "title": "Equipment Handover & Release", "context": "\nFormal procedure for interaction between maintainer and operator at equipment exchange (shut down and release) and incorporate the following:\n Actions required or taken\n Permits & isolation concerns\n Status / condition of equipment\n Equipment / functional testing after maintenance\n Timely acceptance by operator(s) upon release\n All tests, clean-up, demob, parts & repairables returned.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 2, "question_text": "1. Does the operator have the ability to refuse acceptance of  equipment?\n2. Does Operations often insist on equipment release prior to completion of maintenance activities?\n3. How often does equipment fail shortly after a maintenance intervention?\n4. Is there timely operator acceptance of equipment?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 72}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(774, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '89', 'user_action', NULL, NULL, false, NULL, '{"id": 89, "title": "Urgent or Unscheduled Work", "context": "\nPriority should be given to performing scheduled work and schedule interruptions must be managed and based on interactions between maintenance and operations.\n", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 3, "question_text": "1. How often does the scheduled work get stopped to perform non-routine work?\n2. How are decisions being made as to what scheduled work gets stopped and by whom?\n3. Is break-in work being monitored and reviewed to ensure that it is truly urgent work?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 72}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(775, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '90', 'user_action', NULL, NULL, false, NULL, '{"id": 90, "title": "Floor tours", "context": "\nTo monitor work execution activities and provide feedback on progress and quality of work\n SHE is observed, questioned and corrected\n Work quality interaction\n Delays recorded\n Actions & contingencies listed\n Improvement opportunities identified.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 4, "question_text": "1. How often does the supervisor visit tasks during execution?\n2. What questions are asked during these visits? \n3. Does the supervisor seek out problems and contribute to the solutions?\n4. Does supervisor communicate his findings with crews to avoid repetition of failures?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 72}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(776, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '91', 'user_action', NULL, NULL, false, NULL, '{"id": 91, "title": "Material Management - Execution Spares", "context": "\n Spares should be managed as close to a just in time approach as possible without creating undue business risk.\n Spares should be kitted & staged and delivered to the scheduled spares area on the day required.\n All spares should be managed within the stores.\n BOM''s should be immediately updated when found to be incorrect to ensure parts aren''t over or under ordered for jobs.\n", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 5, "question_text": "1. Are jobs often deferred due to lack of spares or spares not arriving in time for scheduled work?\n2. Do Supervisors and Maintainers keep squirrel stores or their own ''stash'' of spares?\n3. Are spares consolidated and delivered to maintenance on the day they are required?\n4. Are the right spares kept on the shelf?\n5.Is there a process to investigate the cause of parts not being delivered in time for execution?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 72}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(777, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '92', 'user_action', NULL, NULL, false, NULL, '{"id": 92, "title": "Productivity & Quality", "context": "\nMonitoring the productivity of the maintenance crews will ensure the completion of maintenance activities as per the plan and schedule and efficient use of opportune time.  This is achieved by monitoring and reporting:\n Planned vs. Actual Performance\n Rework\n Work quality interaction", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 6, "question_text": "1. Does the supervisor review day to day scheduling compliance with planners and crew?\n2. Are there delays in equipment delivery to maintenance by operations?\n3. Is there a process to reschedule incomplete tasks?\n4. Is input from the maintenance crews captured to provide improvements in the history captured and future work planning improvements?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 72}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(790, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '105', 'user_action', NULL, NULL, false, NULL, '{"id": 105, "title": "Data Sources for Defect Identification", "context": "\nDefects are identified through the analysis of various sources of data. \nPotential data sources include:\n Operation Performance data\n Maintenance History / Work Order data\n Logbook data\n Visual Work Place.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 2, "question_text": "1. Are all Operation areas accounted for?\n2. Are all sources utilised?\n3. What data sources are used?\n4. What are the DE data sources in use at site?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 75}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(778, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '93', 'user_action', NULL, NULL, false, NULL, '{"id": 93, "title": "Work Order Completion & Confirmation Training", "context": "\n Aurizon training should be formally provided to new employees and any necessary contractors, and if necessary refreshed annually \n Online training material is readily available and linked to the relevant sections of the WMP.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 1, "question_text": "1. Have maintainers received Work Order Completion training?\n2. Do maintainers understand the importance of capturing work order history?\n3. Have alliance contractors  received Work Order Completion Awareness training?\n4. How are new employees being trained in Work Order Completion?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 73}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(779, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '94', 'user_action', NULL, NULL, false, NULL, '{"id": 94, "title": "Record Maintenance History", "context": "\nFor continuous analysis of failures, the feedback from maintainers into SAP is critical and must include:\n Detailed information on work execution\n Failure modes, causes, parts used and delays recorded    \n Actual time worked (tool-time)\n", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 2, "question_text": "1. What quality of information is being captured onto work history, and feedback / coaching provided to maintainers?\n2. Does the information get captured into the SAP? How?\n3. Do RE''s use available data for analysis?\n4. What percentage of maintenance work orders have history included when Techo''d?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 73}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(780, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '95', 'user_action', NULL, NULL, false, NULL, '{"id": 95, "title": "Time Confirmation", "context": "\nThe accurate capturing of time actually worked is critical. This will allow for:\n The optimisation of planned labour hours on future tasks\n The correct labour cost allocation to work performed\n Must include delay times e.g.: waiting for parts etc.\n Timecard confirmation review process in place.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 3, "question_text": "1. What is the variance between Planned vs. Actual being reported?\n2. Are maintainers aware of the importance of capturing accurate times to work orders?\n3. Does a time and attendance process drive a behaviour of capturing incorrect actual times to work orders?\n4. Is there a process for optimising task lists or standard jobs based on actual times historical information?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 73}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(781, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '96', 'user_action', NULL, NULL, false, NULL, '{"id": 96, "title": "Closing Work Orders", "context": "\nThe Closing / confirming process is a critical step in WMP performance metrics and must be done in a timely manner.\n", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 4, "question_text": "1. How much variance in performance data based on delayed closing of work orders?\n2. Are maintainers aware of the consequence of delayed closing on performance metrics?\n3. Do supervisors use the metrics to drive behaviour change in closing or work orders?\n4. SAP-sites question: How many jobs are TECO''ed with zero (0) hours?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 73}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(782, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '97', 'user_action', NULL, NULL, false, NULL, '{"id": 97, "title": "Material Management - Complete", "context": "\nIt is important that repairable, rotable and left over materials are well managed and consider:\n Must be done in a timely manner\n Ensures a safe workplace\n Correct information must be supplied\n Install / Dismantle procedures for Rotables is followed\n There are no outstanding material requirements on TECO''ed work orders.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 5, "question_text": "1. Are there materials left lying around the work area after work is completed and then tidied up on an adhoc basis?\n2. Is there clear cleaning and tagging requirements and delivery locations for rotable, repairable and unused materials?\n3. Does everyone know the requirements and follow them?\n4. Is the SAP updated in the appropriate way to ensure that credits are applied to the correct cost area and the inventory levels managed?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 73}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(783, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '98', 'user_action', NULL, NULL, false, NULL, '{"id": 98, "title": "Meetings - Weekly Review", "context": "\nWeekly plans, schedules and metrics reviewed to identify potential improvement opportunities.\n Participation from both maintenance, operations and service departments such as Warehouse\n Agenda followed and minuted\n Identify what went well\n Identify what did not go well - potential improvements\n Identify what can be done to prevent recurrence of non-conformance.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 1, "question_text": "1. Is the schedule (spreadsheet, Gantt chart, etc.) referred to during the review?\n2. Is Maintenance & operations related delays/losses discussed?\n3. Is action item list up to date with names & dates?\n4. Are actions completed in a timely manner?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 74}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(784, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '99', 'user_action', NULL, NULL, false, NULL, '{"id": 99, "title": "Meetings - 24-hour daily review", "context": "\nDaily Review to identify potential improvement opportunities\n Agenda followed and minuted\n Identify what went well\n Identify what did not go well\n Identify what can be done to prevent recurrence of non-conformances\n Discuss any  Notifications raised or whether or not a Noti is required for something\n", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 2, "question_text": "1. Work order completion is reviewed? Do maintainers attend these sessions?\n2. At the 24 hr review, is the following done: Any PM not scheduled needs to be questioned. Any Corrective needs to be questioned. Did it need to be done straight away or could it have been scheduled?\nIs the failure mode captured in the equipment PM?\nIf Yes, Do we need to complete an RCA, PMO on the strategy applied? Is there an action plan?\n3. Is action item list up to date with names & dates?\n4. Are actions completed in a timely manner?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 74}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(785, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '100', 'user_action', NULL, NULL, false, NULL, '{"id": 100, "title": "KPI data", "context": "\nAppropriate metrics must be in place to measure effectiveness of process:\n Metrics developed \n Posted in appropriate work areas\n Utilised to drive behaviour change\n Review of overdue statutory requirements\n", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 3, "question_text": "1. Are metrics posted and up to date?\n2. Are metrics understood by all?\n\n - Are appropriatemetrics in place to measure effectiveness of the work management process? \n - Are the metrics accessible to all relevant personnel and stakeholders?\n - Are metrics posted and up to date?\n - Do the metrics include quality and cost performance?\n3. Are new metrics being rolled out on a regular basis?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 74}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(786, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '101', 'user_action', NULL, NULL, false, NULL, '{"id": 101, "title": "Work Management Feedback to / Inclusion of Reliability Group", "context": "\nInteraction between the WMP and the Reliability Processes (Defect Elimination & Asset Strategy & Tactics) is crucial and must include:\n Loss Analysis data\n Repetitive failures occurrences (chronic/systemic)\n Changes in Tactics\n Changes in operating conditions\n Improvements or recommendations\n Cost over-runs\n", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 4, "question_text": "1. How is repetitive failures reported to the Reliability Group?\n2. Does the Reliability group have access to the KPI''s and WM system?\n 3. Where are all the reported findings /  recommendation captured - are the teams using Notifications?\n4. How does the information get reported back to the maintenance teams?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 74}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(787, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '102', 'user_action', NULL, NULL, false, NULL, '{"id": 102, "title": "SAP/ERP (Enterprise Resource Planning)", "context": "\nA SAP is an essential part of the Asset Management Business Process.  The extent to which it is developed and used can create a significant impact on the capability and effectiveness of a site''s asset management function.  This practice aims to understand the level of maturity of the SAP on the site.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 5, "question_text": "1. Is the SAP capable of easily generating routine reports and data extractions for:\n  - Budgeting and cost control.\n  - Quality work orders and check sheets in a user  friendly format, attachments such as drawings or  photos.\n  - Quality schedules in a user friendly format\n  - Equipment history sorted as required\n  - Pareto and other data analysis\n2. Do links exist to the following systems:\nFinance including payroll and budgeting?\nSupply including inventory, warehousing and  purchasing?\noperations reporting and delay logging?\nMaintenance systems such as equipment  strategies, condition monitoring, maintenance  procedures, drawing and equipment registers?\nOther systems such as safety, environment or\nquality?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 74}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(788, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '103', 'user_action', NULL, NULL, false, NULL, '{"id": 103, "title": "Roles / Responsibilities", "context": "\nClear diliniation between reliability & Planning, maintenance, supply & operations is key to process consiistency and efficiency\n", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 6, "question_text": "1. Are there clearrolesandresponsibilities defined within each step of the work management process?\n", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 74}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(789, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '104', 'user_action', NULL, NULL, false, NULL, '{"id": 104, "title": "Operation Loss Monitoring", "context": "\nA process exists to capture Operation lossesandequipmentdowntime/delays", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 1, "question_text": "1. Is there an automated system to capture Operation loss,\n2. Is the system covering all areas of Operation,\n3. Are failure modes and causes captured?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 75}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(791, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '106', 'user_action', NULL, NULL, false, NULL, '{"id": 106, "title": "Observations Leading to Defect Identification", "context": "\nA process is in place to capture defects through observations and escalate into DE process (as appropriate)\nSources of observation data:\n Direct observation\n Interviews\n Safety interactions\n Floor Tours / Task Analysis.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 3, "question_text": "1. Are observations made by technicians, maintainers and operators used to identify defects during execution of work?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 75}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(792, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '107', 'user_action', NULL, NULL, false, NULL, '{"id": 107, "title": "Incident Investigations", "context": "\nA process exists to capture defects identified by incident investigations.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 4, "question_text": "1. Are defects identified using incident reports?\n2. What RCA tools are used in incident investigation?\n3. How are defects captured from your SHE system transferred to the defect register?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 75}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(793, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '108', 'user_action', NULL, NULL, false, NULL, '{"id": 108, "title": "DE Management Team", "context": "\nThe Defect Elimination (DE) Management Team meets monthly to identify new DE projects and review current projects? The following functions should be presented in the DE Management Team meeting:\n Operations\n Maintenance\n Logistics.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 5, "question_text": "1. Is the DE management team represented by more than just maintenance?\n2. Is there an agenda?\n3. Is there a structured report or database that is reviewed during the meeting?\n4. How are actions captured from the meeting? Are meeting minutes distributed?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 75}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(794, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '109', 'user_action', NULL, NULL, false, NULL, '{"id": 109, "title": "PotentialCriticalDefectIdentification", "context": "\nIs there a process in place to identifypotentialdefectsthat have a high consequence and low probability of occuring?", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 6, "question_text": "1. Is there a process to identify potential defects, and provide solutions prior to occurrence, which have high consequences & very low frequency.\n2. Is there a process to identify potential defects from management of change initiatives?\n3. What process is used to identify potential defects? Do you use Reliability Block Modelling, FMECA''s etc. to identify future defects?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 75}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(795, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '110', 'user_action', NULL, NULL, false, NULL, '{"id": 110, "title": "NewEquipmentDefectIdentification", "context": "\nIs there a process in place to identifypotentialdefectsduring the feasibility review and design phases of new projects and equipment?", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 7, "question_text": "1. Is there a process to identify future defects in the design phase?\n2. How does your site liaise with capital expansion project groups (PDI etc.)?\n3. What process is used to identify potential defects? Do you use Reliability Block Modelling, FMECA''s etc. to identify future defects for new equipment?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 75}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(796, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '111', 'user_action', NULL, NULL, false, NULL, '{"id": 111, "title": "Assess and Prioritise Defects", "context": "\nDefects are assessed and prioritised by quantifying the risk and value of eliminating the defect.\nEstimates must be made for the following factors:\n Value of eliminating the defect\n Risk the defect poses to the business\n Difficulty in eliminating the defect\n Cost to eliminate defect.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 1, "question_text": "1. Does the Defect Register identify the value of each potential defect in monetary terms?\n2. What models/processes are applied to assessing/prioritising defects?\n3. Do you have triggers that require the site to automatically commence an RCA?\n4. Is Safety, Health, and Environment (SHE) considered?\n5. Is reputation considered?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 76}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(856, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '171', 'user_action', NULL, NULL, false, NULL, '{"id": 171, "title": "Links to CMMS (SAP)\n", "context": "", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 5, "question_text": "1. What level of interaction occurs between Asset Health tech''s and RE''s?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 87}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(798, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '113', 'user_action', NULL, NULL, false, NULL, '{"id": 113, "title": "Selection of Process", "context": "\nA decision is made as to whether a team-based approach is necessary or if the defect can be assigned to an individual to \"just do it\". \nThere are agreed triggers to initiate the defect elimination process ", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 3, "question_text": "1. Are  triggers defined/documented for various levels of loss analysis, depending on the severity/impact of the loss?\n2. Is a formalised process implemented for front- line personnel to conduct basic RCA''s (e.g. 5- why, etc.)?\n3. Is a formalised process implemented for Reliability engineers or maintenance/ops specialists to conduct more complex RCAs for significant/complex losses?\n4. Are complex RCA''s are managed as projects?\n5. Is a formalised process implemented for Reliability engineers or maintenance/ops specialists to conduct an annual/bi-annual review of significant business losses or accumulating losses not picked up at individual loss event?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 76}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(799, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '114', 'user_action', NULL, NULL, false, NULL, '{"id": 114, "title": "DE Team Selection", "context": "\nTeams are selected to work on Defect Elimination projects. The DE Management team must ensure the team is sufficiently resourced.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 4, "question_text": "1. Is there attendance at Defect Elimination team meetings?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 76}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(800, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '115', 'user_action', NULL, NULL, false, NULL, '{"id": 115, "title": "Process Alignment", "context": "\nThe Defect Elimination process is aligned with other Business Improvement initiatives on site? (i.e. MoC, continuous improvement etc).", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 5, "question_text": "1. Is there an escalation process to ensure that defects impacting multiple sites/departments are considered?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 76}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(801, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '116', 'user_action', NULL, NULL, false, NULL, '{"id": 116, "title": "Data Presentation", "context": "\nUndesirable events are analysed in Pareto format and presented at the Monthly DE Management Team meeting.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 6, "question_text": "1. Are emerging issues identified from the data presented?\n2. Are data sources outside of the maintenance sphere used?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 76}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(802, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '117', 'user_action', NULL, NULL, false, NULL, '{"id": 117, "title": "Root Cause Analysis (RCA) Methods", "context": "\nMultiple Root Cause Analysis (RCA) methods are made available to the DE Team and are personnel trained in their use.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 1, "question_text": "1. Are there personnel trained in each of the different tools available?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 77}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(803, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '118', 'user_action', NULL, NULL, false, NULL, '{"id": 118, "title": "Selection of RCA method", "context": "\nThere are many methods and processes available to assist in the identification of the root causes of a defect.\nThe specific method chosen will depend on a number of factors:\n Problem complexity\n Risk defect poses\n Problem Dimensions\n If a team is being used.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 2, "question_text": "1. Is there criteria for what tool or technique will be used?\n2. Is the criteria based on actual or potential impact to the business?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 77}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(804, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '119', 'user_action', NULL, NULL, false, NULL, '{"id": 119, "title": "Problem Statement", "context": "\nA Team Charter is developed for each DE Team that includes a clear problem statement.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 3, "question_text": "1. Are team charters developed including problem statements?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 77}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(805, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '120', 'user_action', NULL, NULL, false, NULL, '{"id": 120, "title": "Team Composition", "context": "\nKey stakeholders are represented in the Defect Elimination Team to provide input into the problem and solution analysis? Teams should include roles such as:\n Facilitator\n Team Leader\n Reliability Engineer\n Team Members (representing areas effected).", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 4, "question_text": "1.  How many teams are active and are they comprised of more than just maintenance personnel?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 77}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(806, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '121', 'user_action', NULL, NULL, false, NULL, '{"id": 121, "title": "Documentation of RCA", "context": "\nThe RCA documentation is accessible so others in Aurizon may reference them if they have similar issues.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 5, "question_text": "1. Is there an easily accessible database of all RCA''s that have been completed?\n2. Does the documentation include photos and conclusions?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 77}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(807, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '122', 'user_action', NULL, NULL, false, NULL, '{"id": 122, "title": "Identify potential actions", "context": "\nAre all potential solutions and actions evaluated by the responsible DE Team or individual and are they formally documented?\nSolutions and actions have to address the root causes as well as any contributing factors.   ", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 1, "question_text": "1. Are the teams always focused on getting to the root cause.", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 78}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(808, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '123', 'user_action', NULL, NULL, false, NULL, '{"id": 123, "title": "Evaluation of potential actions", "context": "\nAll potential actions are evaluated against specific criteria. Actions should be evaluated in terms of:\n Addressing the root cause\n SHE Implications\n Cost to implement\n Ease of implementation.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 2, "question_text": "1. Does the owner of the relevant cost centre get to sign off on the actions?\n2. Is the evaluation methodology aligned with the site''s Edge evaluation method?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 78}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(809, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '124', 'user_action', NULL, NULL, false, NULL, '{"id": 124, "title": "Action Plan", "context": "\nDetailed action plans developed with clear accountability.\n Action plans should include:\n Actions\n Accountability\n Targets & deliverables\n Status.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 3, "question_text": "Placeholder", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 78}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(810, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '125', 'user_action', NULL, NULL, false, NULL, '{"id": 125, "title": "Establish a measurement plan", "context": "\nA measurement plan is in place that includes a baseline with appropriate measures / KPI and targets.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 4, "question_text": "1. Is the criteria for success clearly defined and understood by the team and management?\n2. Do the KPIs both help to track and manage project progress and ultimately whether or not the project goals were achieved?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 78}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(811, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '126', 'user_action', NULL, NULL, false, NULL, '{"id": 126, "title": "Approval", "context": "\nProper approval is obtained for all actions prior to implementation (i.e.: change management).", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 1, "question_text": "1. Is there a clearly defined process that is documented?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 79}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(819, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '134', 'user_action', NULL, NULL, false, NULL, '{"id": 134, "title": "Recognition", "context": "\nThe DE Management Team gives recognition and feedback for success to the DE team members? ", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 5, "question_text": "1.  Do team members of completed projects feel they are recognized for their efforts?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 80}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(812, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '127', 'user_action', NULL, NULL, false, NULL, '{"id": 127, "title": "Accountability", "context": "\nClear accountabilities are established for the completion of the action plan and is it syndicated with management. \nAccountabilities to include:\n Project management\n Action completion\n Action management\n Cost management\n Monitoring progress.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 2, "question_text": "1. Does management understand the actions assigned to team members that report to them?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 79}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(813, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '128', 'user_action', NULL, NULL, false, NULL, '{"id": 128, "title": "Action close out", "context": "\nThe DE Team''s actions and progress reviewed at the monthly DE Management Team meeting. Any slippage in actions must be addressed through additional resources, tools or collaboration.\n", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 3, "question_text": "1. Are current projects on track?\n2. Is allowance made for people to complete their DE actions as well as their other work?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 79}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(814, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '129', 'user_action', NULL, NULL, false, NULL, '{"id": 129, "title": "Tracking Progress", "context": "\n DE Team progress is tracked using various documents?\n Meeting Minutes\n Who Does What When List (Actions Log)\n Defect Register.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 4, "question_text": "1. Is there a DE action register for team based activities?\n2. Are larger DE activities formally managed as Projects?\n3. Are the DE Teams using the DE register to help track their projects?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 79}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(815, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '130', 'user_action', NULL, NULL, false, NULL, '{"id": 130, "title": "Business process for defect elimination", "context": "An effective business process should be defined for defect elimination.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 1, "question_text": "1. Has a business process been implemented which defines the following:\n A formalised register/tracker is in place to monitor action status from initiation to closure?\n A post-completion audit is defined to validate the effectiveness of defect elimination actions?\ndaily/weekly/monthly/annual loss reporting, review and analysis?\n A process is defined to share the learnings across the company but also to vendors and wider industry? ", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 80}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(816, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '131', 'user_action', NULL, NULL, false, NULL, '{"id": 131, "title": "DE Management Review", "context": "\nThe DE Teams should be regularly reporting progress back through to the DE Management Team. ", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 2, "question_text": "1. Does the agenda for the DE Management Team meeting include time for review of past projects?\n2. Does the DE Management Team''s review of current projects focus on KPI''s and targets?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 80}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(817, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '132', 'user_action', NULL, NULL, false, NULL, '{"id": 132, "title": "Sustainability", "context": "\nThe long-term sustainability actions are assured through scheduled reviews of past DE projects. ", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 3, "question_text": "1. Are any projects completed in the past year still monitored for sustainability?\n2. Are there ever any long term KPI''s allocated to DE projects?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 80}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(818, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '133', 'user_action', NULL, NULL, false, NULL, '{"id": 133, "title": "Outcomes", "context": "\nThe outcomes of the DE Project are updated in the Defect Register and are the outcomes syndicated? ", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 4, "question_text": "1. Is there much awareness about the successful outcome of DE projects throughout the organization?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 80}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(881, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_rating_scales', '22', 'user_action', NULL, NULL, false, NULL, '{"id": 22, "name": "Level 2", "value": 2, "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.110871+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.110871+00:00", "description": "Imported scale level 2", "order_index": 1, "questionnaire_id": 6}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.110871+00'),
	(820, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '135', 'user_action', NULL, NULL, false, NULL, '{"id": 135, "title": "Asset Criticality", "context": "\nCriticality Analysis is important for determining where to focus Asset Tactic Development activities.  Criticality is based on consequence and likelihood.  Categories may include:\n Safety, Health & Environmental\n Costs\n Operational.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 1, "question_text": "1. Are supervisors, planners and technicians aware of the criticality ranking of equipment or systems?\n2. Is criticality ranking updated as new changes are made to tactics?\n3. Is criticality ranking updated as operational requirements change?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 81}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(821, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '136', 'user_action', NULL, NULL, false, NULL, '{"id": 136, "title": "Risk Management", "context": "\nIt is important for determining where to focus Asset Tactic Development activities. Risk Management is based on consequence and likelihood utilising the Aurizon Enterprise Risk Management Framework and Appetite.\nCategories may include:\n Safety & Environmental\n Costs\n Operation.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 2, "question_text": "1. Are supervisors, planners and coordinators aware of the Aurizon Enterprise Risk Management Framework and Appetite?\n2. Is Risk rating updated as new changes are made to tactics? Is this communicated to site leadership?\n3. Is Risk rating updated as operational requirements change?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 81}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(822, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '137', 'user_action', NULL, NULL, false, NULL, '{"id": 137, "title": "Asset Tactic Development Database", "context": "\nA database is important to document analysis and track decision making history. Some other functions of a database are:\n Developing equipment hierarchies & structures\n Statistical Analysis\n Asset Tactic Development database containing common failure mechanisms etc.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 1, "question_text": "1. Does the database have a logical hierarchy of equipment with a breakdown structure for critical equipment?\n2. Does the database contain a listing of common failure modes?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 82}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(823, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '138', 'user_action', NULL, NULL, false, NULL, '{"id": 138, "title": "Review of Tactics", "context": "\nA process should be in place which will trigger a re-evaluation of tactics.  Triggers for re-evaluation can include:\n Time-Based\n Poor Performance\n Change in conditions\n Defect Elimination\n Change in operating context.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 2, "question_text": "1. Is there evidence of tactics review sessions?\n2. Are the triggers for review documented?\n3. Does the Reliability group report on reviews that have been completed?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 82}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(824, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '139', 'user_action', NULL, NULL, false, NULL, '{"id": 139, "title": "Team-Based Tactics Development", "context": "\nA team-based approach to Asset Tactic Development will improve the effectiveness of the overall program.  Teams are normally involved in the development & implementation steps:\n Asset Tactic Development analysis\n Data gathering\n Field Validation.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 3, "question_text": "1. Are there agendas and action plans available?\n2.  Have the recommendations made by previous teams actually made it into the SAP/CMMS system?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 82}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(825, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '140', 'user_action', NULL, NULL, false, NULL, '{"id": 140, "title": "Selection of Projects", "context": "\nTactics development projects are prioritised and selected based on specific criteria:\n Criticality\n Performance\n Value.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 4, "question_text": "1. Does a prioritized list exist?\n2. Does each program have clearly defined boundaries for analysis?\n3. Are projects normally of short duration and frequent rather than large and intermittent?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 82}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(852, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '167', 'user_action', NULL, NULL, false, NULL, '{"id": 167, "title": "Asset Selection Process\n", "context": "", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 1, "question_text": "1. Have visual inspection routes been established?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 87}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(826, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '141', 'user_action', NULL, NULL, false, NULL, '{"id": 141, "title": "FMECA/RCM Process", "context": "\nAny tactics development project must include some level of FMECA/RCM/PMO analysis.  Steps involve identifying:\n Functions\n Functional Failures\n Failure Modes\n Failure Effects\n Failure Consequences\n Task Evaluation and Selection (RCM).", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 5, "question_text": "1. Do FMECA/RCM/Reverse RCM/PMO based tasks have clearly defined functions, functional failures, failure modes & consequences documented?\n2. Was the selected methodology followed to determine the most effective task and interval?\n3. Are reasonable failure modes identified?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 82}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(827, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '142', 'user_action', NULL, NULL, false, NULL, '{"id": 142, "title": "Key Roles", "context": "\nKey Roles are important for the development and implementation of tactics development analyses and their sustainability. Key Roles are:\n Process Owner \n Process Champion or Sponsor\n Asset Tactic Development Analyst.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 6, "question_text": "1.  Is a RACI for tactics development readily available\n2.  Does everyone understand their role in the process?\n3. Are responsibilities defined as to work content and quality?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 82}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(828, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '143', 'user_action', NULL, NULL, false, NULL, '{"id": 143, "title": "Tactics development Training", "context": "\nSuitable Asset Tactic Development methodologies require properly trained and experienced personnel to ensure the effectiveness of the Asset Tactic Development program.  Training should be ongoing and include training plans for:\n Management\n Asset Tactic Development practitioners\n Team Members. ", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 7, "question_text": "1. Can the training department show evidence of  an active Reliability training program?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 82}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(829, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '144', 'user_action', NULL, NULL, false, NULL, '{"id": 144, "title": "Decision History", "context": "\nIt is important to record the decision-making history behind tasks and intervals used in a maintenance strategy.  This will facilitate:\n Review and updating of tactics\n Identifying gaps in information needs.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 1, "question_text": "1. Can the organization demonstrate how critical tasks or intervals were determined?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 83}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(830, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '145', 'user_action', NULL, NULL, false, NULL, '{"id": 145, "title": "Asset Tactic Development-Critical Equipment Tactics", "context": "\nTasks and associated intervals recorded in a Tactics database should reflect the actual maintenance strategies in use:\n Tasks (and intervals) for critical equipment should exist in the Asset Tactic Development database\n Tasks for critical equipment should have had some level of FMECA/RCM analysis.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 2, "question_text": "1. Can critical tasks in CMMS be found in the Asset Tactic Development database?\n2.  Are critical tasks derived from a FMECA/RCM analysis? ", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 83}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(831, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '146', 'user_action', NULL, NULL, false, NULL, '{"id": 146, "title": "Document Design", "context": "\nTasks effectiveness is influenced in how they are presented as service sheets or other such documentation. Documentation guidelines should exist as:\n Standard templates\n Standard terminology\n Clearly defined fields for feedback\n Methods of emphasis.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 1, "question_text": "1. Do service sheets have a standard template?\n2. Are inspection tasks clearly defined as to what is considered acceptable or not?\n3. Are the tasks easily understood?\n4. Are critical tasks emphasized in some way?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 84}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(853, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '168', 'user_action', NULL, NULL, false, NULL, '{"id": 168, "title": "Condition Based Maintenance Access\n", "context": "", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 2, "question_text": "1. How are actionable items reported back to the Asset Health team.", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 87}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(832, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '147', 'user_action', NULL, NULL, false, NULL, '{"id": 147, "title": "Field Validation", "context": "\nFirst time execution of a changed or newly created tactic must be evaluated in the field. Not validating tasks in the field will lead to ineffective tactics and a lack of confidence in the entire program.\nField validation should focus on ensuring:\n Safety, Ergonomic or Environmental issues resolved\n Proper sequencing of tasks\n Equipment access issues\n Identify tools and parts requirements\n Identify training needs.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 2, "question_text": "1. Is there a form to validate new service sheets or tasks?\n2. Have all safety considerations considered when new tasks are implemented?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 84}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(833, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '148', 'user_action', NULL, NULL, false, NULL, '{"id": 148, "title": "Task Packaging", "context": "\nTasks must integrate with the current maintenance program.  Careful consideration must be taken to how tasks are packaged and scheduled in the maintenance program.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 3, "question_text": "1. Is there a task packaging function for the Asset Tactic Development database used?\n2.  Do tasks have an actual interval less than the derived interval from the FMECA/RCM/Reverse RCM/PMO analysis?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 84}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(834, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '149', 'user_action', NULL, NULL, false, NULL, '{"id": 149, "title": "Change Management", "context": "\nChange Management procedures are crucial to ensure maintenance tasks & procedures comply with the selected methodology (e.g., RCM, FMECA,  PMO) principles\n Safety\n Materials\n Tasks including specification.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 4, "question_text": "1. Is the ability to change tasks or intervals tightly controlled?\n2. Does everybody understand the processes?\n3.  Is there a form required before any changes can be made?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 84}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(835, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '150', 'user_action', NULL, NULL, false, NULL, '{"id": 150, "title": "Asset Performance Review", "context": "\n A continuous process of improving maintenance tactics requires the monitoring of various sources of information on equipment performance and task effectiveness:\n Cost Reports\n Trend Analysis\n Failure Analysis\n Tactics Review\n Defect Elimination\n Integrity Risk Assessment.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 1, "question_text": "1. Are Pareto charts used?\n2. Are there reports available comparing expected performance vs revised Asset Tactic Development expected performance?\n3.  Is there an active review of failure information for new failure modes?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 85}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(836, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '151', 'user_action', NULL, NULL, false, NULL, '{"id": 151, "title": "PMO (Preventative Maintenance  Optimisation)", "context": "\nPMO is a review of equipment performance to determine the effectiveness of tactics already in place and:\n Maybe used for equipment with significant history and well understood life cycles\n Is a method to rapidly review current tactics in bulk.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 2, "question_text": "1. Have equipment tactics been reviewed to change, eliminate or extend intervals of tasks? Does Senior Management?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 85}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(837, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '152', 'user_action', NULL, NULL, false, NULL, '{"id": 152, "title": "Collaboration", "context": "\nCollaboration is important to share information and resources across organizations to help improve Asset Tactic Development outcomes.  Collaboration can come in many forms:\n Asset Management (AM) engagements\n Common Practice Work Groups (CPWGs)\n Multi-Site Projects.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 3, "question_text": "1. Does Senior Management encourage people to work together on Asset Tactic Development projects?\n2. Does Senior Management feel responsible for the performance of the Asset Tactic Development process?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 85}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(854, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '169', 'user_action', NULL, NULL, false, NULL, '{"id": 169, "title": "Condition Monintoring Inspection Routes\n", "context": "", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 3, "question_text": "1. Is the information (data) centralised?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 87}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(838, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '153', 'user_action', NULL, NULL, false, NULL, '{"id": 153, "title": "Asset Tactics Integrated with Defect Elimination", "context": "        \n A process exists to ensure recommendations for tactics improvement generated from the Defect Elimination process are reviewed and incorporated into existing asset tactics.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 4, "question_text": "1. Does a Defect Elimination process exist?\n2. Are recommendations for tactics improvement from the Defect Elimination process reviewed and incorporated into existing tactics?\n3. Are tactics changes generated by the Defect Elimination process reviewed and approved prior to implementation?\n4. How often are tactics changed to as an outcome of a DE project? Do you have an example of this?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 85}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(839, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '154', 'user_action', NULL, NULL, false, NULL, '{"id": 154, "title": "Senior Management Support", "context": "\nManagement support is needed to ensure the process is producing results and can continue to improve.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 5, "question_text": "1. Does Senior Management encourage people to work together on Asset Tactic Development projects?\n2. Does Senior Management feel responsible for the performance of the Asset Tactic Development process?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 85}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(840, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '155', 'user_action', NULL, NULL, false, NULL, '{"id": 155, "title": "The Asset Tactic Development Process", "context": "\nTo sustainably manage and improve the Asset Tactics the organisation should have a clearly defined and documented Asset Tactics Development (AS&T) process.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 6, "question_text": "1. Is their a schematic or flowchart that accurately reflects the actual process?\n2. Is there a comprehensive documented program for Asset Tactic Development?\n3. Was the process designed or just developed over time?\n4. Are the Asset Tactic Development process schematics referred to when developing the process?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 85}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(841, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '156', 'user_action', NULL, NULL, false, NULL, '{"id": 156, "title": "Links to Work Management", "context": "\nThere should be clearly defined links between the Work Management Analyse Step and Asset Tactic Development to facilitate the review of Tactics identified as possibly not addressing the relevant failure modes. \nThis is one of the key maintenance business improvement steps.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 7, "question_text": "1. Is there a schematic or flowchart that accurately reflects the actual process?\n2. How often are Asset Tactics reviewed as a result of information coming out of the post schedule review meeting?\n3. Do the maintenance execution teams understand the link between the MBP Improve step and Asset Tactic Development?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 85}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(842, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '157', 'user_action', NULL, NULL, false, NULL, '{"id": 157, "title": "Equipment Modification Review", "context": "\nThis process will ensure equipment modifications have been reviewed to ensure they will be supported by the maintenance function prior to being operational.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 8, "question_text": "1. Are modifications to equipment made without maintenance support considerations?\n2. Is the concept of modifications well defined?  For example, does it include changes to lubricants or parts specifications?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 85}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(843, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '158', 'user_action', NULL, NULL, false, NULL, '{"id": 158, "title": "Acquisition of New Equipment", "context": "\nThe Asset Tactic Development process should be an integral part of the acquisition of new equipment:\n  Identify costly failure modes\n Ensure maintenance support requirements are met \n  Identify design changes to ensure maintainability\n Determine life cycle expectations\n Develop critical spares listings.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 9, "question_text": "1. How early in the acquisition phase is the Reliability group consulted?\n2. Are equipment specifications requested based on the selected methodology (RCM, FMEA, PMO) analysis?  Safety items, support tooling etc.", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 85}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(882, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_rating_scales', '23', 'user_action', NULL, NULL, false, NULL, '{"id": 23, "name": "Level 3", "value": 3, "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.110871+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.110871+00:00", "description": "Imported scale level 3", "order_index": 2, "questionnaire_id": 6}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.110871+00'),
	(844, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '159', 'user_action', NULL, NULL, false, NULL, '{"id": 159, "title": "New Technology", "context": "\nIncorporating  new technologies into the current maintenance plan to reduce reliance on physical inspections and calendar-based maintenance is an important part of the Asset Tactic Development Process.\nThere should be mechanisms in place to prompt a review of Tactics where new or previously unknown technologies are identified.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 10, "question_text": "1. How are new technologies monitored?\n2. Who looks for new and useful technologies?\n3. How often do Tactics get reviewed or updated due to new or previously unknown technologies?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 85}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
	(845, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'INSERT', 'questionnaire_questions', '160', 'user_action', NULL, NULL, false, NULL, '{"id": 160, "title": "Performance Metrics", "context": "\nThe Asset Tactic Development program should increase the reliability and performance of equipment under its governance.  Metrics or KPI''s are established to measure the effectiveness and output of the  Asset Tactic Development process and to identify where Tactics may need to be reviewed. Some measures are: \n Equipment performance metrics\n Unscheduled work spend\n  Cost avoidance\n  AR''s completed in a timely manner.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T09:00:56.002454+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T09:00:56.002454+00:00", "order_index": 11, "question_text": "1. Do Reliability Engineers measure the suitability or effectiveness of asset tactics?\n2. Are the number of corrective actions resulting from inspections and condition monitoring tasks measured?\n3. Are the KPI''s being used to identify where asset tactics require review?", "questionnaire_id": 6, "rating_scale_mapping": null, "questionnaire_step_id": 85}', '{}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 09:00:56.002454+00'),
