INSERT INTO "public"."measurement_definitions" ("id", "created_at", "updated_at", "name", "description", "calculation_type", "provider", "objective", "calculation", "required_csv_columns", "unit", "min_value", "max_value", "active", "is_deleted", "deleted_at") VALUES
	(37, '2025-09-08 04:19:48.403232+00', '2025-09-08 04:19:48.403232+00', 'Available Capacity Hours', 'Total maintenance capacity availability by week from current schedule week to future 26 weeks.', 'sum', 'SAP', 'To view available capacity hours by maintenance work centre, providing a forward-looking snapshot of available capacity.', NULL, NULL, NULL, 0, 9999, true, false, NULL),
	(48, '2025-09-08 04:19:51.7407+00', '2025-09-08 04:19:51.7407+00', 'Notification Priority Age', 'A summation of notifications age per priority type divided by the count of notifications per priority type.', 'average', 'SAP', 'To understand the assessment of notification priorities and to how well we are managing the workload. Priorities of work being performed must be determined based on set guidelines and in line with maintenance and operation requirements.', 'Notification Priority = Total Notification Age by Priority / Count of Notifications by Priority', '[{"name": "close_date", "data_type": "date", "description": null}, {"name": "creation_date", "data_type": "date", "description": null}, {"name": "notification_id", "data_type": "string", "description": null}, {"name": "priority", "data_type": "string", "description": null}]', NULL, 0, 9999, false, false, NULL),
	(49, '2025-09-08 04:19:52.047271+00', '2025-09-08 04:19:52.047271+00', 'Work Order Priority Age', 'A summation of work orders age per priority type divided by the count of work orders per priority type.', 'average', 'SAP', 'To view how prioritisation of work for planning and scheduling is completed using work order priorities and to observe how well we are managing the workload. Priorities of work being performed must be determined based on set guidelines and in line with maintenance and operation requirements.', 'Work Order Priority = Total Work Order Age by Priority / Count of Work Orders by Priority', '[{"name": "close_date", "data_type": "date", "description": null}, {"name": "creation_date", "data_type": "date", "description": null}, {"name": "priority", "data_type": "string", "description": null}, {"name": "work_order_id", "data_type": "string", "description": null}]', NULL, 0, 9999, false, false, NULL),
	(58, '2025-09-08 04:19:54.737611+00', '2025-09-08 04:19:54.737611+00', 'Effective Labour Rate', 'The total of all direct and indirect labour costs is divided by all work order hours confirmed over the same period.', 'average', 'SAP', 'To view the effect of internal labour cost per hour for maintenance work and to benchmark this across depots and compare against budget.', 'Effective Labour Rate = Total All Costs / Total All Time Confirmations', '[{"name": "completion_date", "data_type": "date", "description": null}, {"name": "labour_cost", "data_type": "number", "description": null}, {"name": "time_confirmation_hours", "data_type": "number", "description": null}, {"name": "work_order_id", "data_type": "string", "description": null}]', NULL, 0, 9999, false, false, NULL),
	(59, '2025-09-08 04:19:54.997859+00', '2025-09-08 04:19:54.997859+00', 'Material Management (Future)', 'All work orders with a return material movement on a work order captures the date the material was returned compared to the work order completion and then averaged in days.', 'average', 'SAP', 'To view the effectiveness and management of materials not used on work orders through the timeliness for return.', 'Material Management = Sum(Return Material Date - Work Order Completion Date) / Total Count Material Returns', '[{"name": "completion_date", "data_type": "date", "description": null}, {"name": "return_material_date", "data_type": "date", "description": null}, {"name": "work_order_id", "data_type": "string", "description": null}]', NULL, 0, 9999, false, false, NULL),
	(36, '2025-09-08 04:19:48.091485+00', '2025-09-08 04:19:48.091485+00', 'Task List Usage', 'Total Work orders completed in previous 12 months that has utilised a task list for work planning over the same period.', 'ratio', 'SAP', 'To view the percentage of completed work orders which had a Task List attached. A large percentage of work orders with Task Lists attached indicates that Work Management can produce quality work orders with predetermined resources, materials and documents.', 'Task List Utilisation = All completed Work Orders / All completed Work Orders with Task List', '[{"name": "completion_date", "data_type": "date", "description": null}, {"name": "task_list_id", "data_type": "string", "description": null}, {"name": "work_order_id", "data_type": "string", "description": null}]', NULL, 0, 1, true, false, NULL),
	(38, '2025-09-08 04:19:48.757724+00', '2025-09-08 04:19:48.757724+00', 'Notification Turnover', 'A ratio of all notifications converted to a work order in less than 24 hours over all notifications.', 'ratio', 'SAP', 'To view the effectiveness of managing notifications and when they are reviewed.', 'Notification Turnover = All Notifications Converted to Work Orders in under 24 Hours / All Notifications', '[{"name": "creation_date", "data_type": "date", "description": null}, {"name": "notification_id", "data_type": "string", "description": null}, {"name": "work_order_creation_date", "data_type": "date", "description": null}]', NULL, 0, 1, true, false, NULL),
	(39, '2025-09-08 04:19:49.060908+00', '2025-09-08 04:19:49.060908+00', 'Task List Materials Usage (Manual DIFOT)', 'A ratio of task lists with materials on them measured against all task lists used on closed work orders.', 'ratio', 'SAP', 'To view the use of task lists with materials that enable effective execution of planned maintenance work and takes into consideration the implications of likely break-in work.', 'Task List Materials Usage = Work Orders Closed with Materials from Task Lists / All Work Orders Closed with Task Lists', '[{"name": "material_id", "data_type": "string", "description": null}, {"name": "task_list_id", "data_type": "string", "description": null}, {"name": "work_order_id", "data_type": "string", "description": null}, {"name": "work_order_status", "data_type": "string", "description": null}]', NULL, 0, 1, false, false, NULL),
	(40, '2025-09-08 04:19:49.371284+00', '2025-09-08 04:19:49.371284+00', 'Notification Close Out Quality', 'A ratio of all completed quality work orders/notifications against all work orders. A quality notification closed is when all the below criteria is completed:\nDamage Code\nCause Code\nSystem Code\nComponent Code', 'ratio', 'SAP', 'To view the percentage of notifications completed with all required information. Accurate recording of maintenance history enables analysis for productivity and efficiency improvements.', 'Notification Close Out Quality = Quality Closed Out Notifications / All Notifications Closed', '[{"name": "cause_code", "data_type": "string", "description": null}, {"name": "component_code", "data_type": "string", "description": null}, {"name": "damage_code", "data_type": "string", "description": null}, {"name": "notification_id", "data_type": "string", "description": null}, {"name": "notification_status", "data_type": "string", "description": null}, {"name": "system_code", "data_type": "string", "description": null}, {"name": "work_order_status", "data_type": "string", "description": null}]', NULL, 0, 1, false, false, NULL),
	(41, '2025-09-08 04:19:49.664696+00', '2025-09-08 04:19:49.664696+00', 'Workload Control (Manual)', 'A ratio of all planned work orders against all work orders. A planned work order is when the work order has a revision set against it.', 'ratio', 'SAP', 'To view pending planned work. Workload Control is maintained to assist with budgeting and co-ordinating of major maintenance and other significant events affecting Operations planning.', 'Workload Control = All Planned Work Orders / All Work Orders', '[{"name": "revision", "data_type": "string", "description": null}, {"name": "work_order_id", "data_type": "string", "description": null}, {"name": "work_order_status", "data_type": "string", "description": null}]', NULL, 0, 1, false, false, NULL),
	(42, '2025-09-08 04:19:49.957083+00', '2025-09-08 04:19:49.957083+00', 'Asset Not Available Reschedule Work', 'A ratio of all rescheduled work orders with status RSAU against all work orders.', 'ratio', 'SAP', 'To view the impact to planned schedule work/compliance due to assets not arriving when requested. It allows us to gain an appreciation of the magnitude of adherence to Schedule.', 'Asset Not Available Reschedule Work = All Rescheduled Work Orders with Status RSAU / All Work Orders', '[{"name": "reschedule_status", "data_type": "string", "description": null}, {"name": "work_order_id", "data_type": "string", "description": null}, {"name": "work_order_status", "data_type": "string", "description": null}]', NULL, 0, 1, false, false, NULL),
	(43, '2025-09-08 04:19:50.253194+00', '2025-09-08 04:19:50.253194+00', 'Schedule Compliant', 'The percentage of the scheduled work that was completed in the last 12 months. Work Order measure by count of work orders completed. Scheduled work is all work orders in the current week with a revision assigned.', 'ratio', 'SAP', 'To view the effectiveness of the scheduling process and completion of work for the schedule period', 'Schedule Compliant = All Work Orders Completed / All Scheduled Work Orders', '[{"name": "completion_date", "data_type": "date", "description": null}, {"name": "revision", "data_type": "string", "description": null}, {"name": "scheduled_start_date", "data_type": "date", "description": null}, {"name": "work_order_id", "data_type": "string", "description": null}, {"name": "work_order_status", "data_type": "string", "description": null}]', NULL, 0, 1, false, false, NULL),
	(44, '2025-09-08 04:19:50.546412+00', '2025-09-08 04:19:50.546412+00', 'Preventive Work Effectiveness', 'The percentage of corrective work with status FOO, identified from scheduled preventative and corrective work measured over all closed work orders in the last 12 months. Work orders are a measure by count.', 'ratio', 'SAP', 'To view the effectiveness of scheduled preventative and corrective work in identifying corrective work to ensure the asset can be utilised between maintenance periods and break-in work is minimised.', 'Preventative Work Effectiveness = All Corrective Work Orders with Status FOO from Scheduled Work / All Work Orders Closed', '[{"name": "completion_date", "data_type": "date", "description": null}, {"name": "work_order_id", "data_type": "string", "description": null}, {"name": "work_order_status", "data_type": "string", "description": null}, {"name": "work_order_type", "data_type": "string", "description": null}]', NULL, 0, 1, false, false, NULL),
	(45, '2025-09-08 04:19:50.855791+00', '2025-09-08 04:19:50.855791+00', 'Asset Handover Effectiveness (Future)', 'Asset Handover Effectiveness is defined as the percentage of calendar time that the asset was not operating before maintenance begun', 'ratio', 'other', 'To view the time that the asset is idol, albeit productively or non-productively. It provides an overall measure of how well delivery of the Asset and handover is done between Maintenance and Operations.', 'Asset Handover Effectiveness = Asset Handover Time / Total of Asset Handover and Maintenance Downtime Time', '[{"name": "asset_id", "data_type": "string", "description": null}, {"name": "handover_start_time", "data_type": "date", "description": null}, {"name": "maintenance_end_time", "data_type": "date", "description": null}, {"name": "maintenance_start_time", "data_type": "date", "description": null}]', NULL, 0, 1, false, false, NULL),
	(46, '2025-09-08 04:19:51.186154+00', '2025-09-08 04:19:51.186154+00', 'Asset Condition', 'The amount of time an asset has a status code applied to it measured as a percentage of all time by code type.', 'ratio', 'other', 'To view the condition of the Asset using the Status Code for effective prioritisation and planning of Operations and Maintenance tasks.', 'Asset Condition For Each Status Code = Time in Code / All Time', '[{"name": "asset_id", "data_type": "string", "description": null}, {"name": "status_code", "data_type": "string", "description": null}, {"name": "status_end_date", "data_type": "date", "description": null}, {"name": "status_start_date", "data_type": "date", "description": null}]', NULL, 0, 1, false, false, NULL),
	(47, '2025-09-08 04:19:51.449671+00', '2025-09-08 04:19:51.449671+00', 'Unplanned Work Orders (Manual)', 'A summation count of all work orders not planned in back and forward scheduling periods divided by the summation count of all work orders grouped by the work order start date.', 'ratio', 'SAP', 'To view total amount of work orders that are not planned ready for scheduling and execution. It indicates how effectively Maintenance is keeping up with the volume of work being generated with the resources available.', 'Unplanned Work Orders = Unplanned Work Orders / All Work Orders', '[{"name": "revision", "data_type": "string", "description": null}, {"name": "work_order_id", "data_type": "string", "description": null}, {"name": "work_order_start_date", "data_type": "date", "description": null}, {"name": "work_order_status", "data_type": "string", "description": null}]', NULL, 0, 1, false, false, NULL),
	(50, '2025-09-08 04:19:52.376834+00', '2025-09-08 04:19:52.376834+00', 'Rework (Future)', 'A notification raised by RDC within 5 days after depot maintenance, measured across all notifications raised, is an indication our maintenance is not being carried out with quality checks.', 'ratio', 'SAP', 'To view the effectiveness and quality of how we executed work during the planned and scheduled period. With quality assurance checks we control the risk of re-work, which is a source of waste and risk of unnecessary downtime/failure.', 'Rework = M2 Notifications by RDC <= 5 Days / All M2 Notifications', '[{"name": "notification_creation_date", "data_type": "date", "description": null}, {"name": "notification_id", "data_type": "string", "description": null}, {"name": "work_order_completion_date", "data_type": "date", "description": null}, {"name": "work_order_id", "data_type": "string", "description": null}]', NULL, 0, 1, false, false, NULL),
	(51, '2025-09-08 04:19:52.670788+00', '2025-09-08 04:19:52.670788+00', 'Planned Equipment Availability (Future)', 'The percentage of calendar time that assets are physically available for work. Calendar time 1440 mins per day and all measurements are to be taken over same period', 'ratio', 'other', 'To view how maintenance work in the future integrates with the operation plans which is reflected by predicting availability of equipment after scheduled maintenance.', 'Equipment Availability = (Calendar Time - Total Hours Future Work Orders) / Calendar Time', '[{"name": "asset_id", "data_type": "string", "description": null}, {"name": "calendar_time", "data_type": "number", "description": null}, {"name": "total_hours_future_work_orders", "data_type": "number", "description": null}]', NULL, 0, 1, false, false, NULL),
	(52, '2025-09-08 04:19:52.924363+00', '2025-09-08 04:19:52.924363+00', 'Break-In Work Ratio', 'The ratio of the break-in maintenance work to the total maintenance work based on work order count calculated over the same period.', 'ratio', 'SAP', 'The break-in work ratio measures the distribution of the maintenance work by showing the type of work that maintenance resources are executing.', 'Break-In Work Ratio = Total Number of Break-In Work Orders Completed / Total Number of Work Orders Completed', '[{"name": "completion_date", "data_type": "date", "description": null}, {"name": "work_order_id", "data_type": "string", "description": null}, {"name": "work_order_status", "data_type": "string", "description": null}, {"name": "work_order_type", "data_type": "string", "description": null}]', NULL, 0, 1, true, false, NULL),
	(53, '2025-09-08 04:19:53.222016+00', '2025-09-08 04:19:53.222016+00', 'Scheduled Loading', 'It is defined as the percentage of total estimated work hours on scheduled work orders for the scheduling period compared to total available manhours for the scheduling period.', 'ratio', 'SAP', 'To view planned utilisation of labour on scheduled work compared to all labour available and the effective use of the work order management system in managing labour.', 'Schedule Loading = Total Estimated Work Hours / Total Work Hours Available', '[{"name": "estimated_work_hours", "data_type": "number", "description": null}, {"name": "scheduled_end_date", "data_type": "date", "description": null}, {"name": "scheduled_start_date", "data_type": "date", "description": null}, {"name": "total_work_hours_available", "data_type": "number", "description": null}, {"name": "work_order_id", "data_type": "string", "description": null}]', NULL, 0, 1, false, false, NULL),
	(54, '2025-09-08 04:19:53.550942+00', '2025-09-08 04:19:53.550942+00', 'Material Demand Forecast (Future)', 'The percentage of materials that are ordered with a requirement date compared to the expected delivery time. Materials are measured as a count.', 'ratio', 'other', 'To view inventory effectiveness with demand forecasting.', 'Material Demand Forecast = Total Materials meet Forecast Date / Total All Materials', '[{"name": "delivery_date", "data_type": "date", "description": null}, {"name": "forecast_date", "data_type": "date", "description": null}, {"name": "material_id", "data_type": "string", "description": null}, {"name": "order_date", "data_type": "date", "description": null}]', NULL, 0, 1, false, false, NULL),
	(55, '2025-09-08 04:19:53.858233+00', '2025-09-08 04:19:53.858233+00', 'Corrective Work Task List Usage (Manual)', 'A ratio of corrective work orders with task list on them measured against all corrective work orders.', 'ratio', 'SAP', 'To view whether task lists are used on corrective work orders that enable effective execution of planned maintenance work.', 'Corrective Work Task List Usage = Corrective Work Orders Closed with Task Lists / All Corrective Work Orders Closed', '[{"name": "task_list_id", "data_type": "string", "description": null}, {"name": "work_order_id", "data_type": "string", "description": null}, {"name": "work_order_status", "data_type": "string", "description": null}, {"name": "work_order_type", "data_type": "string", "description": null}]', NULL, 0, 1, false, false, NULL),
	(56, '2025-09-08 04:19:54.156811+00', '2025-09-08 04:19:54.156811+00', 'Preventive Work Profile', 'Preventative work orders measured against total of all Preventative and Corrective work orders over a period. Period will be measured over the same time frame', 'ratio', 'SAP', 'To view the ratio of Preventative work against Corrective work. It provides an indication of how much work is proactive and scheduled to assure Asset capability.', 'Preventative Schedule Work = Preventative Work Orders / All Work Orders', '[{"name": "completion_date", "data_type": "date", "description": null}, {"name": "work_order_id", "data_type": "string", "description": null}, {"name": "work_order_status", "data_type": "string", "description": null}, {"name": "work_order_type", "data_type": "string", "description": null}]', NULL, 0, 1, false, false, NULL),
	(57, '2025-09-08 04:19:54.450173+00', '2025-09-08 04:19:54.450173+00', 'On Time Material Delivery (Manual DIFOT)', 'Materials required ordered date is compared to the actual delivery time and measured as a percentage that meet the required date.', 'ratio', 'SAP', 'To view inventory efficiency for delivery of materials when required for maintenance. It is an indicator of how supply is meeting maintenance demand in terms of the requested delivery date.', 'On Time Material Delivery = Total Materials Meet Required Date / Total All Materials', '[{"name": "delivery_date", "data_type": "date", "description": null}, {"name": "material_id", "data_type": "string", "description": null}, {"name": "required_date", "data_type": "date", "description": null}]', NULL, 0, 1, false, false, NULL),
	(60, '2025-09-08 04:19:55.288649+00', '2025-09-08 04:19:55.288649+00', 'Labour Wait Time (Manual)', 'Capture total time confirmations from standing work orders that have text reference delayed due to operations divided by all time confirmations to provide a percentage of time spent waiting.', 'ratio', 'SAP', 'To view the time spent by maintenance personnel waiting for assets to be delivered for scheduled maintenance.', 'Labour Wait Time = Total Hours Time Confirmations for Waiting / Total All Time Confirmations', '[{"name": "completion_date", "data_type": "date", "description": null}, {"name": "time_confirmation_hours", "data_type": "number", "description": null}, {"name": "work_order_id", "data_type": "string", "description": null}, {"name": "work_order_text", "data_type": "string", "description": null}]', NULL, 0, 1, false, false, NULL),
	(61, '2025-09-08 04:19:55.592948+00', '2025-09-08 04:19:55.592948+00', 'Labour Estimate Accuracy', 'A ratio of the sum of actual labour hours for all work order operations completed for that period to the sum of planned labour hours for all work order operations completed  expressed as a percentage.', 'ratio', 'SAP', 'To view the accuracy of the work order planning and scheduling function and the effectiveness of the work order feedback process.', 'Labour Estimate Accuracy = Total Hours Actual Time Confirmations for all Operations / Total Hours Planned Time Confirmations for all Operations', '[{"name": "actual_time_confirmation_hours", "data_type": "number", "description": null}, {"name": "completion_date", "data_type": "date", "description": null}, {"name": "planned_time_confirmation_hours", "data_type": "number", "description": null}, {"name": "work_order_id", "data_type": "string", "description": null}]', NULL, 0, 1, false, false, NULL),
	(62, '2025-09-08 04:19:55.920392+00', '2025-09-08 04:19:55.920392+00', 'Notification Ratio', 'A summation of notifications created by RDC compared to all notifications created.', 'ratio', 'SAP', 'To view the ratio of work generated by Operations compared to Maintenance.', 'Notification Ratio = Total Count Notifications Created by RDC / Total Count All Notifications', '[{"name": "created_by", "data_type": "string", "description": null}, {"name": "creation_date", "data_type": "date", "description": null}, {"name": "notification_id", "data_type": "string", "description": null}]', NULL, 0, 1, false, false, NULL),
	(63, '2025-09-08 04:19:56.226256+00', '2025-09-08 04:19:56.226256+00', 'Corrective Work Profile', 'Corrective work orders measured against total of all Preventative and Corrective work orders over a period. Period will be measured over the same time frame', 'ratio', 'SAP', 'To view the ratio of Corrective work against Preventative work. It provides an indication of how much work is reactive or non-proactive and unscheduled in maintaining the Asset.', 'Corrective Profile = Total Count Preventative Work Orders / Total Work Orders Count', '[{"name": "completion_date", "data_type": "date", "description": null}, {"name": "work_order_id", "data_type": "string", "description": null}, {"name": "work_order_status", "data_type": "string", "description": null}, {"name": "work_order_type", "data_type": "string", "description": null}]', NULL, 0, 1, false, false, NULL),
	(64, '2025-09-08 04:19:56.553105+00', '2025-09-08 04:19:56.553105+00', 'Cost Estimate Accuracy (Future)', 'The sum of actual work order costs for all work orders completed for that period compared to the sum planned work order costs for all work orders completed  expressed as a percentage.', 'ratio', 'SAP', 'To view the accuracy of the work order planning function with estimation of works through costing.', 'Cost Estimate Accuracy = Total Actual Work Order Costs / Total Planned Work Order Costs', '[{"name": "actual_work_order_cost", "data_type": "number", "description": null}, {"name": "completion_date", "data_type": "date", "description": null}, {"name": "planned_work_order_cost", "data_type": "number", "description": null}, {"name": "work_order_id", "data_type": "string", "description": null}]', NULL, 0, 1, false, false, NULL),
	(65, '2025-09-08 04:19:56.849278+00', '2025-09-08 04:19:56.849278+00', 'Preventative Work Compliance (Manual)', 'A percentage of preventative work orders completed on time measured against all preventative work orders compliance date over a period.', 'ratio', 'SAP', 'To view effectiveness of completing Preventative work on time to assure Asset compliance and capability.', 'Preventative Work Compliance = Total Preventative Work Orders Completed on Time / Total Preventative Work Orders', '[{"name": "completion_date", "data_type": "date", "description": null}, {"name": "compliance_date", "data_type": "date", "description": null}, {"name": "work_order_id", "data_type": "string", "description": null}, {"name": "work_order_status", "data_type": "string", "description": null}, {"name": "work_order_type", "data_type": "string", "description": null}]', NULL, 0, 1, false, false, NULL),
	(66, '2025-09-08 04:19:57.112872+00', '2025-09-08 04:19:57.112872+00', 'Break-In Work Ratio Hours', 'The ratio of the break-in maintenance work to the total maintenance work based on hours booked to work order type calculated over the same period', 'ratio', 'SAP', 'The break-in work ratio measures the distribution of the maintenance work by showing the type of work that maintenance resources are executing.', 'Break-In Work Ratio Hours = Total Hours from Break-In Work Orders Completed / Total Hours from All Work Orders Completed', '[{"name": "completion_date", "data_type": "date", "description": null}, {"name": "time_confirmation_hours", "data_type": "number", "description": null}, {"name": "work_order_id", "data_type": "string", "description": null}, {"name": "work_order_status", "data_type": "string", "description": null}, {"name": "work_order_type", "data_type": "string", "description": null}]', NULL, 0, 1, true, false, NULL),
	(67, '2025-09-08 04:19:57.42043+00', '2025-09-08 04:19:57.42043+00', 'Scheduled  Work Type Ratio', 'The percentage of the all scheduled work orders over 12 months as a ratio of Preventative (PM01) and Corrective (PM02). Work Order measure by count of work orders. Scheduled work is all work orders in the current week with a revision assigned.', 'ratio', 'SAP', 'To view the ratio of work type scheduled for the schedule period.', 'Schedule Type Ratio = PM01 or PM02 Work Orders / Total All PM01 & PM02 Work Orders', '[{"name": "completion_date", "data_type": "date", "description": null}, {"name": "revision", "data_type": "string", "description": null}, {"name": "scheduled_start_date", "data_type": "date", "description": null}, {"name": "work_order_id", "data_type": "string", "description": null}, {"name": "work_order_status", "data_type": "string", "description": null}, {"name": "work_order_type", "data_type": "string", "description": null}]', NULL, 0, 1, true, false, NULL);
INSERT INTO "public"."questionnaire_rating_scales" ("id", "created_at", "updated_at", "name", "description", "order_index", "value", "created_by", "questionnaire_id", "is_deleted", "deleted_at", "company_id") VALUES
	(1, '2025-10-31 03:41:14.098691+00', '2025-10-31 03:41:14.098691+00', 'Critical', 'Significant issues requiring immediate intervention. Performance well below acceptable standards with multiple failures or blockages.', 1, 1, '00000000-0000-0000-0000-000000000001', 1, false, NULL, 'b64d182f-0ee3-40a0-b367-281f31902620'),
	(2, '2025-10-31 03:41:24.042281+00', '2025-10-31 03:41:24.042281+00', 'Below Standard', 'Notable challenges impacting effectiveness. Performance below expectations with frequent issues requiring corrective action.', 2, 2, '00000000-0000-0000-0000-000000000001', 1, false, NULL, 'b64d182f-0ee3-40a0-b367-281f31902620'),
